'2014-02-03 17:34:01',2),(1749,373,'PS','en','<p>adjective</p>','2014-02-03 17:34:13',2),(1750,373,'PR','en','<p>/waɪd/</p>','2014-02-03 17:34:20',2),(1751,373,'ET','en','<p>Old English, from wīd</p>','2014-02-03 17:34:30',2),(1752,213,'DE','en','<p>pertaining to spore ornamentation, see irregular rugose.</p>','2014-02-03 17:34:50',2),(1753,213,'PS','en','<p>adjective</p>','2014-02-03 17:35:00',2),(1754,213,'PR','en','<p>/ˈrɪŋkli/</p>','2014-02-03 17:35:08',2),(1755,213,'ET','en','<p>Old English, from gewrinclod</p>','2014-02-03 17:35:23',2),(1756,348,'DE','en','<p>having a shape similar to a zigzag; a series of short sharp turns in progression or course.</p>','2014-02-03 17:35:45',2),(1757,348,'PS','en','<p>adjective</p>','2014-02-03 17:36:28',2),(1758,348,'PR','en','<p>/ˈzɪgˌz&aelig;g/</p>','2014-02-03 17:36:41',2),(1759,348,'ET','en','<p>French, from zigzag</p>','2014-02-03 17:36:52',2),(1760,247,'NA','en','','2014-02-03 18:43:18',2),(1764,300,'DE','en','<p>a spore formed within a sporangium</p>','2014-02-04 18:31:21',2),(1765,299,'DE','en','<p>a spore formed within a sporangium.</p>','2014-02-04 18:32:32',2),(1766,302,'DE','en','<p>the production of spores</p>','2014-02-04 18:34:06',2),(1767,898,'DE','en','<p>A type of electron microscopy in which a specimen is scanned by an electron beam which moves in a zigzag raster; a second electron beam synchronously scans a cathode ray tube with a similar raster. Electrons which are secondarily emitted from the specimen are collected and used to control the intensity of the beam in the CRT. this effect produces a pattern of light corresponding to the surface topography of the specimen.</p>','2015-03-05 16:39:57',3),(1768,899,'DE','en','<p>The abbreviation for Scanning electron microscopy.</p>','2015-03-05 16:45:18',3),(1769,895,'DE','en','<p>Microscopy in which an electron beam interacts with a specimen and subsequently contributes (directly or indirectly) to the formation of an image of that specimen.</p>','2015-03-05 16:46:19',3),(1770,900,'DE','en','<p>The abbreviation for Electron microscopy.</p>','2015-03-05 16:48:56',3),(1771,896,'DE','en','<p>A type of electron microscopy in which an electron beam passes through the specimen which deflects or scatters some of the electrons, electrons whose paths are slightly deviated by the specimen are focused onto a fluorescent screen to form an image of the specimen.</p>','2015-03-05 16:50:35',3),(1772,897,'DE','en','<p>The abbreviation for Transmission electron microscopy.</p>','2015-03-05 16:53:27',3),(1773,901,'NA','en','<p>A type of electron microscopy in which electrons pass through the specimen and the energies of the emergent electrons are measured in an analyzer which then constructs an image of the specimen.</p>','2015-03-05 17:23:55',3),(1775,904,'DE','en','<p>A form of microscopy used for a colourless specimen which absorbs little light and would not be visable by bright-field microscopy.</p>','2015-03-05 18:05:52',3),(1776,905,'DE','en','<p>The most common form of light microscopy. This is usually the method that is meant by the term \"microscopy\". Microscopy in which light from a lamp is concentrated by a condenser and directed onto a specimen (which is usually examined on a slide which rests on the stage), then a series of lenses forms a magnified image of the specimen. This method results in an image of the specimen seen against a lighter background (hence, bright-field). One drawback of this approach is that translucent specimens are often poorly visible unless stained.</p>','2015-03-05 19:25:19',3),(1777,906,'DE','en','<p>A form of microscopy commonly used for examining objects too small to be seen by bright field microscopy. For low or medium power work, the underside of the condenser is fitted with an opaque disc which only allows peripheral rays to pass through the condenser, thus forming a hollow cone of light whose apex is focused in the plane of the specimen. This specimen scatters the rays, some of which enter the objective and form a bright image of the specimen against a dark background (hence, dark-field). For high power work a special oil immersion is used.</p>','2015-03-05 19:28:11',3),(1778,909,'DE','en','<p>A form of microscopy in which a specimen is treated with fluorochrome (usually) and irradiated with ultraviolet radiation and the light emitted forms the image of the specimen in a manner similar in principle to that in bright field microscopy.</p>','2015-03-05 19:40:03',3),(1779,910,'DE','en','<p>A form of microscopy in which ultraviolet radiation is used for both illumination of the specimen and for formation of an image. The image is recorded on a fluorescent screen or on a photographic plate.</p>','2015-03-05 19:44:00',3),(1780,911,'DE','en','<p>Any form of microscopy in which the illuminating beam is focused on the specimen by the objective. The objective acts simultaneously as the condenser and objective lens.</p>','2015-03-05 19:52:55',3),(1781,912,'DE','en','<p>A type of electron microscopy in which very small specimens are cooled rapidly to very low temperatures without prior dehydration such that the water in the specimen forms a \"glass like\" solid without undergoing crystallization.</p>','2015-03-05 19:54:23',3),(1782,913,'NA','en','<p>An experimental form of microscopy which will allow the three dimensional observation of biological specimens at the atomic level.</p>','2015-03-05 19:55:41',3),(1783,914,'DE','en','<p>A picture made using a camera. A picture produced by photography. An image which is focused onto film or other light sensitive material and then made permanently visible by chemical treatment or digital storage.</p>','2015-03-05 20:38:52',3),(1784,915,'DE','en','<p>Intracellular enveloped magnetic bodies that are present in magnetotactic bacteria and cause cells to align with lines of magnetic force. This allows magnetotactic bacteria to direct cell motility by magnetic field.</p>','2015-03-09 16:47:14',3),(1785,915,'PS','en','<p>noun</p>','2015-03-09 16:49:11',3),(1786,190,'DE','en','<p>the molecule that undergoes a specific reaction with an enzyme.</p>','2015-03-27 18:53:08',3),(1787,934,'ET','en','<p>Medieval Latin, from filamentum</p>','2015-03-27 19:52:28',3),(1788,934,'PR','en','<p>/ˌfɪləˈmɛntəs/</p>','2015-03-27 19:52:46',3),(1789,934,'PS','en','<p>adjective</p>','2015-03-27 19:53:11',3),(1790,934,'DE','en','<p>pertaining to colony edge morphology, having margins with thread or fiber like projections. In layman\'s terms; fuzzy in appearance</p>','2015-03-27 19:53:47',3),(1791,94,'ET','en','<p>Latin, from butyrum</p>','2015-03-30 15:42:24',3),(1792,936,'DE','en','<p>pertaining to colony texture, having a mucus like and slimy consistency/texture.</p>','2015-03-30 15:52:54',3),(1793,936,'PS','en','<p>adjective</p>','2015-03-30 15:54:54',3),(1794,936,'PR','en','<p>/ˈmyukɔɪd/</p>','2015-03-30 15:55:10',3),(1795,936,'ET','en','<p>Latin muc-, from mucus</p>','2015-03-30 15:55:31',3),(1796,937,'DE','en','<p>A mode of fission in which one cell gives rise to many others. This process may involve repeated binary fission taking place within a common envelope, or nuclear divisions followed by the incorporation of each nucleus in a separate daughter cell.</p>','2015-03-30 17:00:19',3),(1797,937,'PS','en','<p>noun</p>','2015-03-30 17:01:01',3),(1798,942,'ET','en','<p>Greek, from mīkro &amp; āer &amp; philos</p>','2015-03-30 19:47:30',3),(1799,942,'PS','en','<p>noun</p>','2015-03-30 19:48:03',3),(1800,942,'PR','en','<p>/ˌmaɪkrəʊˈɛərəʊˌfaɪl/</p>','2015-03-30 19:49:17',3),(1801,942,'DE','en','<p>pertaining to an organism which grows optimally in a microaerobic environment. Organisms which, in nature, normally grow in the presence of small amounts of oxygen.</p>','2015-03-30 19:49:39',3),(1802,943,'ET','en','<p>Greek, from āer &amp; Latin, from tolerant. Greek, from an, āer &amp; b&iacute;os</p>','2015-03-30 19:56:54',3),(1803,943,'PS','en','<p>noun</p>','2015-03-30 19:57:24',3),(1804,943,'DE','en','<p>pertaining to an anaerobe which can survive or grow in the presence of oxygen. But at suboptimal rates of growth.</p>','2015-03-30 19:57:46',3),(1805,944,'ET','en','<p>Middle English, from obligat. Greek, from an, āer &amp; b&iacute;os</p>','2015-03-30 20:03:15',3),(1806,944,'PS','en','<p>noun</p>','2015-03-30 20:03:35',3),(1807,944,'PR','en','<p>/ˈɒblɪgɪt ˈ&aelig;nəˌroʊb/</p>','2015-03-30 20:04:02',3),(1808,944,'DE','en','<p>a type of anaerobe which can only (must) grow in the absence of oxygen.</p>','2015-03-30 20:04:22',3),(1809,945,'NA','en','<p>synonymous to obligate anaerobe</p>','2015-03-30 20:15:06',3),(1810,945,'PS','en','<p>noun</p>','2015-03-30 20:09:07',3),(1811,945,'PR','en','<p>/strɪkt ˈ&aelig;nəˌroʊb/</p>','2015-03-30 20:09:23',3),(1812,945,'ET','en','<p>Latin, from strictus. Greek, from an, āer &amp; b&iacute;os</p>','2015-03-30 20:09:45',3),(1813,947,'ET','en','<p>Latin, from strictus. Greek, from āer &amp; b&iacute;os</p>','2015-03-30 20:13:07',3),(1814,947,'PR','en','<p>/strɪkt ˈɛəroʊb/</p>','2015-03-30 20:13:20',3),(1815,947,'PS','en','<p>noun</p>','2015-03-30 20:13:39',3),(1816,947,'NA','en','<p>synonymous to obligate aerobe</p>','2015-03-30 20:14:44',3),(1817,946,'ET','en','<p>Middle English, from obligat. Greek, from āer &amp; b&iacute;os</p>','2015-03-30 20:15:35',3),(1818,946,'PR','en','<p>/ˈɒblɪgɪt ˈɛəroʊb/</p>','2015-03-30 20:16:03',3),(1819,946,'PS','en','<p>noun</p>','2015-03-30 20:16:14',3),(1820,946,'DE','en','<p>a type of aerobe which can only (must) grow in an environment where oxygen is present at partial pressures similar to those in air.</p>','2015-03-30 20:40:19',3),(1821,949,'PS','en','<p>noun</p>','2015-03-31 18:22:30',3),(1822,949,'DE','en','<p>A common mode of asexual reproduction in microorganisms whereby two (daughter) cells are formed by the growth and division of one cell. Transverse binary fission occurs when a cell divides across it\'s longitudinal axis. Longitudinal binary fission occurs when a cell divides along its longitudinal axis.</p>','2015-03-31 18:23:16',3),(1823,950,'ET','en','<p>Latin, from fissiōn</p>','2015-03-31 18:26:30',3),(1824,950,'PR','en','<p>/ˈfɪʃən/</p>','2015-03-31 18:27:07',3),(1825,950,'PS','en','<p>noun</p>','2015-03-31 18:27:20',3),(1826,950,'DE','en','<p>Cell division in which cell growth is followed by septum formation which divides the fully grown cell into two separate cells that are similar or identical (daughter cells).</p>','2015-03-31 18:29:19',3),(1827,952,'NA','en','<p>See GC%</p>','2015-03-31 18:32:33',3),(1828,953,'NA','en','<p>See GC%</p>','2015-03-31 18:32:50',3),(1829,954,'NA','en','<p>See GC%</p>','2015-03-31 18:33:15',3),(1830,951,'DE','en','<p>(Normally pertaining to chromosomal DNA.) The percentage of the total nucleic acid that consists of guanine plus cytosine bases. Calculated as [(guanine+cytosine)/(adenine+thymine+guanine+cytosine)] (in which each base name represents the relative molar amount of that base). Expressed as mol% GC. This value is useful in microbial taxonomy.</p>','2015-03-31 18:33:49',3),(1831,955,'DE','en','<p>A dissymmetry ratio of microbial DNA calculated as [(adenine+thymine)/(guanine+cytosine)] (in which each base name represents the relative molar amount of that base)</p>','2015-03-31 18:35:24',3),(1832,956,'ET','en','<p>Latin, from bīlis</p>','2015-03-31 18:37:39',3),(1833,956,'PR','en','<p>/baɪl/</p>','2015-03-31 18:38:11',3),(1834,956,'DE','en','<p>Steroid carboxylic acids which are synthesized in the liver to aid in the digestion of fats. The salts and amides of bile acids are useful ingredients in media selective for enteric bacteria as they are inhibitory to many non-enteric bacteria.</p>','2015-03-31 18:40:54',3),(1835,957,'DE','en','<p>micrometer</p>','2015-03-31 18:42:31',3),(1836,958,'DE','en','<p>The reduction of dinitrogen (N2) to ammonia (NH3) by the enzyme nitrogenase. Biological nitrogen fixation is carried out by some bacteria.</p>','2015-03-31 18:45:52',3),(1837,959,'NA','en','<p>see nitrogen fixation</p>','2015-03-31 18:47:19',3),(1838,960,'PR','en','<p>\\(ˌ)dē-ˌnī-trə-fə-ˈkā-shən\\</p>','2015-03-31 18:48:42',3),(1839,960,'DE','en','<p>Respiratory metabolism in which nitrate(NO3-) or nitrite (NO2-) acts as terminal electron acceptor, and is sequentially reduced to mainly dinitrogen (N2) and/or nitrous oxide (N2O).</p>','2015-03-31 18:49:43',3),(1840,960,'PS','en','<p>noun</p>','2015-03-31 18:50:31',3),(1841,961,'DE','en','<p>A process by which sewage or industrial wastewater is treated. The process involves introducing a mass of bacteria and protozoa to wastewater and then vigorously aerating the mixture by agitation.</p>','2015-03-31 19:01:16',3),(1842,961,'PS','en','<p>noun</p>','2015-03-31 19:07:23',3),(1843,962,'DE','en','<p>Culture media whose exact chemical composition (including trace substances) is quantitatively known.</p>','2015-03-31 19:11:12',3),(1844,962,'PS','en','<p>noun</p>','2015-03-31 19:13:19',3),(1845,963,'PS','en','<p>noun</p>','2015-03-31 19:33:28',3),(1846,963,'DE','en','<p>Culture media whose exact chemical composition is not known. Also called undefined medium.</p>','2015-03-31 19:33:45',3),(1847,964,'NA','en','<p>see complex medium</p>','2015-03-31 19:34:48',3),(1848,964,'PS','en','<p>noun</p>','2015-03-31 19:35:01',3),(1849,965,'DE','en','<p>The time required for a population to double.</p>','2015-03-31 19:37:09',3),(1850,966,'NA','en','<p>see doubling time</p>','2015-03-31 19:38:48',3),(1851,966,'PS','en','<p>noun</p>','2015-03-31 19:39:22',3),(1852,965,'PS','en','<p>noun</p>','2015-03-31 19:41:21',3),(1853,967,'DE','en','<p>A given strain of organism or a trait in an organism which is characteristic of the majority of naturally occurring members of its kind.</p>','2015-03-31 19:55:18',3),(1854,968,'ET','en','<p>Greek from h&yacute;dōr &amp; l&yacute;sis</p>','2015-03-31 19:57:55',3),(1855,968,'PR','en','<p>/haɪˈdrɒləsɪs/</p>','2015-03-31 19:58:29',3),(1856,968,'PS','en','<p>noun</p>','2015-03-31 20:00:13',3),(1857,968,'DE','en','<p>The breakdown of a polymer into smaller units by the addition of water.</p>','2015-03-31 20:01:21',3),(1858,969,'PS','en','<p>proper noun</p>','2015-03-31 20:05:29',3),(1859,969,'DE','en','<p>The NIH genetic sequence database, an annotated collection of all publicly available DNA sequences.</p>','2015-03-31 20:09:52',3),(1860,138,'DE','en','<p>Pertaining to chemistry, possessing hydrophilic characteristics and generally water soluble.</p>','2015-03-31 20:17:27',3),(1861,970,'DE','en','<p>A designation which indicates a newly proposed genus at the time of its initial publication.</p>','2015-03-31 20:37:49',3),(1862,971,'NA','en','<p>see genus novum. The abbreviation used for \"genus novum\"</p>','2015-03-31 20:40:16',3),(1863,972,'DE','en','<p>A designation which indicates a newly proposed species at the time of its initial publication.</p>','2015-03-31 20:41:23',3),(1864,973,'NA','en','<p>see species nova. The abbreviation used for \"species nova\"</p>','2015-03-31 20:42:15',3),(1865,974,'DE','en','<p>The name of a species which has been moved from one genus to another but which has retained the specific epithet.</p>','2015-04-01 14:52:00',3),(1866,975,'NA','en','<p>see comb, nov.</p>','2015-04-01 15:16:19',3),(1867,976,'DE','en','<p>A method often used when testing antibiotic sensitivity and tolerance. This method consists of inoculating the entire surface of an agar plate with a test organism. Then, several small and absorbent paper discs which are impregnated with different antibiotics are placed on the agar surface. After incubation, the antibiotics diffuse creating a zone of growth inhibition around each disc that contains an antibiotic to which the organism is susceptible.</p>','2015-04-01 15:32:46',3),(1868,977,'DE','en','<p>Any procedure used in order to determine if a given bacterial strain produces a coagulase. One of many methods used is the tube test; which involves incubating the test organism with a suitable plasma and observing for clot formation over time.</p>','2015-04-01 15:35:50',3),(1869,979,'NA','en','<p>See methyl red test.</p>','2015-04-01 16:18:20',3),(1870,575,'PS','en','<p>noun</p>','2015-04-01 16:36:19',3),(1871,979,'PS','en','<p>noun</p>','2015-04-01 16:36:34',3),(1872,573,'PS','en','<p>noun</p>','2015-04-01 16:37:44',3),(1873,980,'NA','en','<p>see Voges-Proskauer test</p>','2015-04-01 16:39:25',3),(1874,980,'PS','en','<p>noun</p>','2015-04-01 16:39:41',3),(1875,576,'PS','en','<p>noun</p>','2015-04-01 16:47:00',3),(1876,578,'PS','en','<p>noun</p>','2015-04-01 16:48:13',3),(1877,574,'PS','en','<p>noun</p>','2015-04-01 16:51:01',3),(1878,981,'DE','en','<p>A pH indicator which turns from red (at pH 4.4) to yellow (at pH 6.2).</p>','2015-04-01 16:55:06',3),(1879,981,'PS','en','<p>noun</p>','2015-04-01 16:55:17',3),(1880,982,'DE','en','<p>Liquid derived from domestic sewage or industrial sources, which cannot be discarded (untreated) into lakes or streams.</p>','2015-04-01 18:15:40',3),(1881,982,'ET','en','<p>late Middle English, from waste &amp; watre</p>','2015-04-01 18:24:25',3),(1882,982,'PS','en','<p>noun</p>','2015-04-01 18:39:27',3),(1883,983,'DE','en','<p>Any one of the 23 monomers that make up proteins. Chemically, amino acids are two carbon carboxylic acids containing an amino group and a characteristic substituent (known as the \"R group\") on the alpha carbon.</p>','2015-04-16 18:14:17',3),(1884,983,'PS','en','<p>noun</p>','2015-04-01 18:50:00',3),(1885,984,'PR','en','<p>/ˌp&aelig;&theta; oʊ dʒəˈnɪs ɪ ti/</p>','2015-04-01 20:34:39',3),(1886,984,'DE','en','<p>The inherent capability of an organism to produce disease. Sometimes used interchangeably with the term \"virulence\", however virulence refers more to the severity of disease an organism causes within a host.</p>','2015-04-01 20:35:54',3),(1887,984,'PS','en','<p>noun</p>','2015-04-01 20:35:46',3),(1888,984,'ET','en','<p>Greek, from p&aacute;thos &amp; genēs</p>','2015-04-02 14:03:11',3),(1889,985,'ET','en','<p>Greek, from p&aacute;thos &amp; genēs</p>','2015-04-02 14:04:29',3),(1890,985,'PR','en','<p>/ˈp&aelig;&theta; ə dʒən/</p>','2015-04-02 14:04:48',3),(1891,985,'PS','en','<p>noun</p>','2015-04-02 14:05:04',3),(1892,985,'DE','en','<p>A disease causing microorganism. To be more specific, any microorganism which can directly interact with another organism to cause disease in that organism.</p>','2015-04-02 14:05:28',3),(1893,986,'ET','en','<p>Latin, from varietās</p>','2015-04-02 14:07:07',3),(1894,986,'PR','en','<p>/vəˈraɪ ɪ ti/</p>','2015-04-02 14:07:21',3),(1895,986,'DE','en','<p>A taxonomic infrasubspecific rank which has no official standing in nomenclature. Formerly equivalent to subspecies.</p>','2015-04-02 14:07:47',3),(1896,986,'PS','en','<p>noun</p>','2015-04-02 14:08:13',3),(1897,987,'DE','en','<p>A strain or set of similar strains which may be distinguished from other strains (within a given subspecies) based upon its/their pathogenicity for a specific host.</p>','2015-04-02 14:42:59',3),(1898,987,'PS','en','<p>noun</p>','2015-04-02 14:43:16',3),(1899,988,'PR','en','<p>(pěp\'tĭ-dō-glī\'kən)</p>','2015-04-02 14:44:30',3),(1900,988,'PS','en','<p>noun</p>','2015-04-02 14:44:45',3),(1901,988,'DE','en','<p>A polymer which forms a mesh like layer outside the plasma membrane of most bacteria but not archaea, forming a cell wall. Structurally, peptidoglycan is a chain of alternating N-acetylglucosamine and N-acetylmuramic acid residues. Additionally, each N-acetylmuramic acid has a short chain of amino acids attached to it which link to each other forming \"cross links\" between chains. The exact structure of the cell wall varies amongst bacteria (see Gram-type-positive &amp; Gram-type-negative).</p>','2015-04-02 14:45:10',3),(1916,994,'PS','en','<p>noun</p>','2015-04-02 19:05:48',3),(1917,995,'DE','en','<p>A structure which forms a layer external to the cytoplasmic membrane which is responsible for the shape of the cell and protects it from mechanical and osmotic damage. Cell walls occur in algae, plants, fungi, archaea, and bacteria. Both the structure and composition of&nbsp; cell walls vary greatly depending on species. In bacteria, cell walls are composed of peptidoglycan and exist in two distinct types: Gram positive and Gram negative (see Gram-type-positive and Gram-type-negative).</p>','2015-04-02 19:07:38',3),(1918,995,'PS','en','<p>noun</p>','2015-04-02 19:08:06',3),(1919,996,'PR','en','<p>/ˈvɪr yə ləns/</p>','2015-04-02 19:11:33',3),(1920,996,'DE','en','<p>The capability of an organism to produce disease. Sometimes used interchangeably with the term \"pathogenicity\", however virulence refers more to the severity of disease an organism causes within a host (severity of symptoms).</p>','2015-04-02 19:11:52',3),(1921,997,'PR','en','<p>[&prime;&auml;z&middot;mə&sbquo;fīl]</p>','2015-04-02 19:18:47',3),(1922,997,'DE','en','<p>A microorganism which is adapted to environments with high osmotic pressures. Similar to halophiles.</p>','2015-04-02 19:19:18',3),(1923,998,'PR','en','<p>\\ˌ&auml;z-mə-ˈfil-ik\\</p>','2015-04-02 20:39:10',3),(1924,998,'PS','en','<p>adjective</p>','2015-04-02 20:39:23',3),(1925,998,'DE','en','<p>used to describe a microorganism which is adapted to environments with high osmotic pressures. Similar to a halophilic.</p>','2015-04-02 20:41:26',3),(1926,999,'DE','en','<p>A revived name. A new name that is published and was also previously published prior to 1 January 1980 however not included in an Approved List.</p>','2015-04-03 15:22:20',3),(1927,1000,'NA','en','<p>see nomen revictum. The abbreviation used for \"nomen revictum\"</p>','2015-04-03 15:23:04',3),(1928,1001,'DE','en','<p>A viable specimen of a given organism to which a name has been attached and which is regarded as the permanent representative of a given taxon.</p>','2015-04-03 15:25:23',3),(1929,1002,'PR','en','<p>/ˌi mənˈdeɪ ʃən/</p>','2015-04-03 15:26:58',3),(1930,1002,'DE','en','<p>A correction or change of text. Used to indicate an alteration in the outline of a taxon.</p>','2015-04-03 15:27:43',3),(1931,1003,'NA','en','<p>see emendation. The abbreviation used for \"emendation\"</p>','2015-04-03 15:43:48',3),(1932,1004,'DE','en','<p>A name whose application is uncertain. A name which cannot be applied to a specific organism. May be placed on the list of rejected names by the Judicial Commission.</p>','2015-04-03 16:03:47',3),(1933,1005,'DE','en','<p>Any name which has been placed on the list of rejected names. This can done for various reasons by the Judicial Commission (see nomen perplexum, nomen confusum, nomen ambiguum, nomen periculosum, nomen dubium).</p>','2015-04-03 17:15:52',3),(1934,1006,'NA','en','<p>see nomen rejiciendum. The abbreviation used for \"nomen rejiciendum\"</p>','2015-04-03 17:17:32',3),(1935,1007,'NA','en','<p>see nomen dubium. The abbreviation used for \"nomen dubium\"</p>','2015-04-03 17:18:58',3),(1936,1008,'DE','en','<p>A perplexing name. Two or more epithets in the same genus (or two or more generic names) that are so similar as to cause uncertainty (regardless of words from different sources) can be treated as perplexing names. Such cases are referred to the Judicial Commission.</p>','2015-04-03 17:20:11',3),(1937,1009,'DE','en','<p>A name based upon a mixed culture. May be placed on the list of rejected names by the Judicial Commission.</p>','2015-04-03 17:23:06',3),(1938,1010,'DE','en','<p>A name which has been used with different meanings. May be placed on the list of rejected names by the Judicial Commission.</p>','2015-04-03 17:23:44',3),(1939,1011,'DE','en','<p>A name whose application is likely to lead to accidents endangering health or life or both or of serious economic consequences. May be placed on the list of rejected names by the Judicial Commission.</p>','2015-04-03 17:27:06',3),(1940,1012,'NA','en','<p>see conserved name.</p>','2015-04-03 17:48:45',3),(1941,1013,'DE','en','<p>A name which must be used instead of all earlier synonyms and homonyms and must be retained even though it may contravene rules of the relevant code. Only the Judicial Commission can place names on the list of conserved names.</p>','2015-04-03 17:49:32',3),(1942,1014,'DE','en','<p>A taxonomic body concerned with the interpretation and/or amendment of the rules of microbial nomenclature.</p>','2015-04-03 17:50:56',3),(1943,1015,'NA','en','<p>see Judicial Commission . The abbreviation used for \"Judicial Commission\"</p>','2015-04-03 17:51:46',3),(1944,1016,'ET','en','<p>Latin, from amylum + ase</p>','2015-04-03 18:02:57',3),(1945,1016,'PR','en','<p>/ˈ&aelig;m əˌleɪs/</p>','2015-04-03 18:03:13',3),(1946,1016,'PS','en','<p>noun</p>','2015-04-03 18:03:29',3),(1947,1016,'DE','en','<p>an enzyme that hydrolyzes starch or glycogen into sugars (an enzyme that cleaves glucosidic linkages).</p>','2015-04-03 18:03:45',3),(1948,1017,'ET','en','<p>Latin, from amylum + ase</p>','2015-04-03 18:05:08',3),(1949,1017,'DE','en','<p>enzymes which hydrolyze starch or glycogen into sugars (enzymes that cleave glucosidic linkages).</p>','2015-04-03 18:05:19',3),(1950,1017,'PS','en','<p>noun</p>','2015-04-03 18:05:34',3),(1951,1018,'ET','en','<p>Latin for \"on site\"</p>','2015-04-03 18:07:19',3),(1952,1018,'PR','en','<p>/ɪn ˈsaɪ tu/</p>','2015-04-03 18:07:42',3),(1953,1018,'PS','en','<p>adverb or adjective</p>','2015-04-03 18:10:22',3),(1954,1018,'DE','en','<p>Used to describe some process done on site or in its original place.</p>','2015-04-03 18:10:47',3),(1955,1019,'ET','en','<p>Latin for \"within the living\"</p>','2015-04-03 18:14:50',3),(1956,1019,'PR','en','<p>/ɪn ˈvi voʊ/</p>','2015-04-03 18:15:06',3),(1957,1019,'PS','en','<p>adverb or adjective</p>','2015-04-03 18:15:30',3),(1958,1019,'DE','en','<p>Used to describe some process done in (within the body of) a living organism.</p>','2015-04-03 18:16:08',3),(1959,1020,'ET','en','<p>Latin for \"in glass\"</p>','2015-04-03 18:17:05',3),(1960,1020,'PR','en','<p>/ɪn ˈvi troʊ/</p>','2015-04-03 18:17:24',3),(1961,1020,'PS','en','<p>adverb or adjective</p>','2015-04-03 18:17:43',3),(1962,1020,'DE','en','<p>Used to describe some process done outside of a living organism or some process done in a controlled laboratory setting.</p>','2015-04-03 18:18:05',3),(1963,1021,'PR','en','<p>\\in-ˈsi-li-ˌkō\\</p>','2015-04-03 18:19:46',3),(1964,1021,'PS','en','<p>adverb or adjective</p>','2015-04-03 18:20:07',3),(1965,1021,'DE','en','<p>Used to describe some process done using a computer. Can also be used to describe a process done via computer simulation.</p>','2015-04-03 18:20:48',3),(1966,1022,'ET','en','<p>Latin, from homōnymum</p>','2015-04-03 18:25:04',3),(1967,1022,'PR','en','<p>/ˈhɒm ə nɪm/</p>','2015-04-03 18:25:22',3),(1968,1022,'PS','en','<p>noun</p>','2015-04-03 18:26:30',3),(1969,1022,'DE','en','<p>Any name used to refer to each of two or more different microbial taxa of the same rank based on different types.</p>','2015-04-03 18:27:06',3),(1970,1023,'ET','en','<p>Latin, from sterilis</p>','2015-04-03 18:31:29',3),(1971,1023,'PR','en','<p>/ˈstɛr ɪl/</p>','2015-04-03 18:31:57',3),(1972,1023,'PS','en','<p>adjective</p>','2015-04-03 18:32:11',3),(1973,1023,'DE','en','<p>Free of all living cells, viable spores, viruses, and subviral agents capable of replication. Devoid of all forms of life.</p>','2015-04-03 18:32:24',3),(1974,1024,'ET','en','<p>/ˌstɛr ə ləˈzeɪ ʃən/</p>','2015-04-03 18:33:21',3),(1975,1024,'PS','en','<p>noun</p>','2015-04-03 18:35:00',3),(1976,1024,'DE','en','<p>Any process that can render objects or environments sterile.</p>','2015-04-03 18:36:20',3),(1977,1025,'PS','en','<p>adjective</p>','2015-04-03 18:39:54',3),(1978,1025,'DE','en','<p>referring to asepsis.</p>','2015-04-03 18:40:06',3),(1979,1026,'ET','en','<p>Greek, from a+s&ecirc;psis</p>','2015-04-03 18:40:50',3),(1980,1026,'PR','en','<p>/əˈsɛp sɪs/</p>','2015-04-03 18:44:10',3),(1981,1026,'PS','en','<p>noun</p>','2015-04-03 18:44:27',3),(1982,1026,'DE','en','<p>A state of being free from potentially harmful microorganisms. Not to be confused with sterile.</p>','2015-04-03 18:44:43',3),(1983,1027,'PR','en','<p>/b&aelig;kˈtɪər əˌsaɪd/</p>','2015-04-03 19:12:56',3),(1984,1027,'PS','en','<p>noun</p>','2015-04-03 19:13:07',3),(1985,1027,'DE','en','<p>Any substance able to kill at least some types of bacteria.</p>','2015-04-03 19:16:20',3),(1986,1028,'PS','en','<p>adjective</p>','2015-04-03 19:24:12',3),(1987,1028,'DE','en','<p>Able to kill at least some types of bacteria.</p>','2015-04-03 19:24:48',3),(1988,1029,'DE','en','<p>adjective</p>','2015-04-03 19:25:43',3),(1989,1029,'NA','en','<p>see bactericidal</p>','2015-04-03 19:27:05',3),(1990,1030,'DE','en','<p>Able to inhibit the growth and reproduction of at least some types of bacteria.</p>','2015-04-03 19:37:59',3),(1991,1030,'ET','en','<p>/b&aelig;kˌtɪər i əˈst&aelig;t ɪk/</p>','2015-04-03 19:43:15',3),(1992,1030,'PS','en','<p>adjective</p>','2015-04-03 19:43:36',3),(1993,1031,'NA','en','<p>see bacteriostatic</p>','2015-04-03 20:00:00',3),(1994,1032,'NA','en','<p>The abbreviation used for high performance liquid chromatography. See high performance liquid chromatography.</p>','2015-04-03 20:03:35',3),(1995,1033,'DE','en','<p>A type of chromatography that employs very high pressures to force a liquid sample through a tightly packed column of minute particles. Because each component of the sample reacts differently with the column, different flow rates through the column occur for each different component. it is this variance that allows comparison and analysis.</p>','2015-04-03 20:04:29',3),(1996,1034,'PR','en','<p>/ˌkroʊ məˈtɒg rə fi/</p>','2015-04-03 20:16:56',3),(1997,1034,'PS','en','<p>noun</p>','2015-04-03 20:17:15',3),(1998,1034,'DE','en','<p>The separation of molecules in a mixture by any technique which exploits the differing extents to which the different molecules become distributed between a stationary phase contiguous mobile phase.</p>','2015-04-03 20:17:31',3),(1999,1035,'DE','en','<p>A type of chromatography that employs a thin layer on a flat glass support (often a glass plate with a silica gel layer). First, the substance being tested is applied to one end of the plate. Then, one end of the plate is placed in a solvent (known as the \"mobile phase\") and over time that solvent rises up the thin layer by capillary action. This process carries the substances being tested with it. As each different substance is drawn up at a different rate, separation occurs and analysis is possible.</p>','2015-04-03 20:35:05',3),(2000,1036,'NA','en','<p>The abbreviation used for thin layer chromatography. See thin layer chromatography.</p>','2015-04-03 20:37:35',3),(2001,1037,'NA','en','<p>The abbreviation used for polymerase chain reaction. See polymerase chain reaction.</p>','2015-04-07 14:05:31',3),(2002,1038,'DE','en','<p>A method for replicating specific sequences of DNA which is capable of forming millions of copies in hours. First, sample dsDNA is denatured (at ~95&deg;C); then primers bind (at ~45&deg;C) to each strand such that 5\' to 3\' extension of primers will copy the target region. Finally, elongation of strands occurs at around 72&deg;C (this temperature depends on which thermostable polymerase is used) . this cycle is repeated several times as needed.</p>','2015-04-07 14:08:45',3),(2003,1039,'PR','en','<p>/ˈproʊ tiˌeɪs/</p>','2015-04-07 14:21:42',3),(2004,1039,'PS','en','<p>noun</p>','2015-04-07 14:22:05',3),(2005,1039,'PS','en','<p>any enzyme which hydrolyzes peptide bonds in proteins and peptides.</p>','2015-04-07 14:23:05',3),(2006,1040,'PR','en','<p>/ˈpɛp tɪˌdeɪs/</p>','2015-04-07 14:25:31',3),(2007,1040,'PS','en','<p>noun</p>','2015-04-07 14:26:12',3),(2008,1040,'NA','en','<p>synonymous to protease. See protease</p>','2015-04-07 14:27:16',3),(2009,1041,'ET','en','<p>from Latin, gelātus</p>','2015-04-07 14:30:12',3),(2010,1041,'PR','en','<p>/ˈdʒɛl ə tn/</p>','2015-04-07 14:30:38',3),(2011,1041,'PS','en','<p>noun</p>','2015-04-07 14:31:31',3),(2012,1041,'DE','en','<p>Collagen which has been partially hydrolyzed (normally obtained by boiling).</p>','2015-04-07 14:32:00',3),(2013,1042,'ET','en','<p>from Greek, k&oacute;lla + gen</p>','2015-04-07 14:34:38',3),(2014,1042,'PR','en','<p>/ˈkɒl ə dʒən/</p>','2015-04-07 14:35:23',3),(2015,1042,'PS','en','<p>noun</p>','2015-04-07 14:35:52',3),(2016,1042,'DE','en','<p>The main structural protein component of bone, cartilage, and other connective tissues in animals. Structurally, collagen is a microfibrillar protein that consists of three polypeptide chains (each chain being composed of a repeating sequence of three amino acids).</p>','2015-04-07 14:36:15',3),(2017,1043,'PR','en','<p>/kə-lāj\'ə-nās\'/</p>','2015-04-07 14:39:42',3),(2018,1043,'PS','en','<p>noun</p>','2015-04-07 14:39:57',3),(2019,1043,'DE','en','<p>A collagen degrading enzyme or enzyme that breaks down the peptide bonds of collagen. The production of collagenase is a virulence factor in bacteria.</p>','2015-04-07 14:40:34',3),(2020,1044,'DE','en','<p>any enzyme which hydrolyzes gelatin.</p>','2015-04-07 14:41:37',3),(2021,1045,'DE','en','<p>Properties that enable a microorganism to replicate and disseminate within a host and enhance its potential to cause disease.</p>','2015-04-07 14:43:45',3),(2022,1046,'ET','en','<p>from Greek, o&ucirc;ron</p>','2015-04-07 14:45:14',3),(2023,1046,'PR','en','<p>/yʊˈri ə/</p>','2015-04-07 14:45:46',3),(2024,1046,'PS','en','<p>noun</p>','2015-04-07 14:46:07',3),(2025,1046,'DE','en','<p>An organic compound ((NH2)2CO). In animals, urea plays a key role in the metabolism of nitrogenous compounds and is the main nitrogen containing compound in the urine of mammals.</p>','2015-04-07 14:46:51',3),(2026,1047,'ET','en','<p>from Greek, o&ucirc;ron + ase</p>','2015-04-07 14:48:09',3),(2027,1047,'PR','en','<p>/ˈyʊər iˌeɪs/</p>','2015-04-07 14:48:29',3),(2028,1047,'PS','en','<p>noun</p>','2015-04-07 14:48:48',3),(2029,1047,'DE','en','<p>An enzyme which hydrolyses urea into ammonia and CO2.</p>','2015-04-07 14:49:20',3),(2030,1048,'DE','en','<p>Deoxyribonucleic acid. A nucleic acid consisting of deoxyribonucleotides that serves as the repository of genetic information in all cells and some viruses. Structurally, DNA consists of a long repeating chain of deoxyribonucleotides (a strand). However, DNA is often double stranded meaning that two strands engage in complementary base pairing with one another. Under physiological conditions the two strands twist around a common axis to form a \"double helix\".</p>','2015-04-07 14:51:49',3),(2031,1049,'NA','en','<p>see DNA</p>','2015-04-07 14:55:05',3),(2032,1050,'DE','en','<p>Ribonucleic acid. A nucleic acid consisting of ribonucleotides that is involved in coding, decoding, regulation, and expression of genes. RNA also plays a key role in protein synthesis and constitutes the genome of some viruses. Structurally, RNA consists of a long repeating chain of ribonucleotides (a strand).</p>','2015-04-07 14:56:18',3),(2033,1051,'NA','en','<p>see RNA</p>','2015-04-07 14:57:38',3),(2034,1052,'PR','en','<p>/ˈdiˈɛn eɪs/</p>','2015-04-07 15:14:46',3),(2035,1052,'PS','en','<p>noun</p>','2015-04-07 15:15:12',3),(2036,1052,'NA','en','<p>see deoxyribonuclease.</p>','2015-04-07 15:15:28',3),(2037,1053,'PR','en','<p>/diˌɒk sɪˌraɪ boʊˈnu kliˌeɪs/</p>','2015-04-07 15:17:58',3),(2038,1053,'PS','en','<p>noun</p>','2015-04-07 15:18:55',3),(2039,1053,'DE','en','<p>Any enzyme which depolymerizes DNA into mono or oligonucleotide products.</p>','2015-04-07 15:19:25',3),(2040,1054,'PR','en','<p>/ˈɑrˈɛn eɪs/</p>','2015-04-07 15:21:12',3),(2041,1054,'PS','en','<p>noun</p>','2015-04-07 15:22:02',3),(2042,1054,'NA','en','<p>see ribonuclease.</p>','2015-04-07 15:22:27',3),(2043,1055,'PR','en','<p>/ˌraɪ boʊˈnu kliˌeɪs/</p>','2015-04-07 15:23:28',3),(2044,1055,'PS','en','<p>noun</p>','2015-04-07 15:23:44',3),(2045,1055,'DE','en','<p>Any enzyme which cleaves RNA.</p>','2015-04-07 15:24:41',3),(2046,1056,'PR','en','<p>/ˈnu kliˌeɪs/</p>','2015-04-07 15:26:24',3),(2047,1056,'PS','en','<p>noun</p>','2015-04-07 15:26:48',3),(2048,1056,'DE','en','<p>Any enzyme which can cleave the sugar phospahte backbone of a nucleic acid (phosphodiester bonds).</p>','2015-04-07 15:27:19',3),(2049,1057,'PR','en','<p>/ˌɛn doʊˈnu kliˌeɪs/</p>','2015-04-07 15:30:03',3),(2050,1057,'PS','en','<p>noun</p>','2015-04-07 15:30:25',3),(2051,1057,'DE','en','<p>A nuclease that removes nucleotides from one end of a nucleic acid strand sequentially.</p>','2015-04-07 15:30:43',3),(2052,1058,'PR','en','<p>/ˌɛksəʊˈnjuːklɪˌeɪz/</p>','2015-04-07 15:31:44',3),(2053,1058,'PS','en','<p>noun</p>','2015-04-07 15:32:01',3),(2054,1058,'DE','en','<p>A nuclease that cleaves phosphodiester bonds within a nucleic acid strand.</p>','2015-04-07 15:32:50',3),(2055,1059,'ET','en','<p>from Latin, laesiōn</p>','2015-04-07 15:57:01',3),(2056,1059,'NA','en','<p>noun</p>','2015-04-07 15:57:24',3),(2057,1059,'DE','en','<p>A localized region of tissue which has been damaged physically or altered by any pathological process.</p>','2015-04-07 15:58:36',3),(2058,1060,'ET','en','<p>from German, Genom</p>','2015-04-07 16:11:54',3),(2059,1060,'PR','en','<p>/ˈdʒi noʊm/</p>','2015-04-07 16:12:21',3),(2060,1060,'PS','en','<p>noun</p>','2015-04-07 16:12:41',3),(2061,1060,'DE','en','<p>The genetic material of an organism, whether it is encoded in DNA or RNA (as for some viruses) including both genes and non coding regions.</p>','2015-04-07 16:17:41',3),(2062,1060,'DE','en','<p>All the genes in a cell or virion.</p>','2015-04-07 16:17:18',3),(2063,1061,'ET','en','<p>from Middle English, loupe</p>','2015-04-07 16:38:08',3),(2064,1061,'PR','en','<p>/lup/</p>','2015-04-07 16:38:53',3),(2065,1061,'PS','en','<p>noun</p>','2015-04-07 16:41:58',3),(2066,1061,'DE','en','<p>A small wire bent into a closed loop at one end with a handle at the other. This instrument is used in microbiology for manipulating small quantities of solid or liquid material, particularly for inoculation.</p>','2015-04-07 16:41:36',3),(2067,1062,'DE','en','<p>a tool used by microbiologists for retrieving an inoculum. Often simply called a loop.</p>','2015-04-07 16:43:59',3),(2068,1062,'NA','en','<p>See loop.</p>','2015-04-07 16:44:07',3),(2069,1063,'ET','en','<p>from Latin, sedimentum</p>','2015-04-07 18:02:29',3),(2070,1063,'PR','en','<p>/ˈsɛd ə mənt/</p>','2015-04-07 18:02:49',3),(2071,1063,'PS','en','<p>noun</p>','2015-04-07 18:03:05',3),(2072,1063,'DE','en','<p>The matter that settles to the bottom of a liquid.</p>','2015-04-07 18:03:26',3),(2073,1064,'ET','en','<p>from Greek, hyp&eacute;r + trophia</p>','2015-04-07 18:05:14',3),(2074,1064,'PR','en','<p>/haɪˈpɜr trə fi/</p>','2015-04-07 18:05:33',3),(2075,1064,'PS','en','<p>noun</p>','2015-04-07 18:05:55',3),(2076,1064,'DE','en','<p>The enlargement of an organ or tissue owing to an increase in the size of pre-existing cells.</p>','2015-04-07 18:06:16',3),(2077,1065,'ET','en','<p>from Greek, hyp&eacute;r +&nbsp; pl&aacute;s(is)</p>','2015-04-07 18:10:43',3),(2078,1065,'PR','en','<p>/ˌhaɪ pərˈpleɪ ʒə/</p>','2015-04-07 18:11:16',3),(2079,1065,'PS','en','<p>noun</p>','2015-04-07 18:12:22',3),(2080,1065,'DE','en','<p>The enlargement of an organ or tissue owing to an increase in the number of cells.</p>','2015-04-07 18:14:52',3),(2081,1066,'ET','en','<p>&nbsp;from Middle English, fixacion</p>','2015-04-07 18:21:58',3),(2082,1066,'PR','en','<p>/fɪkˈseɪ ʃən/</p>','2015-04-07 18:22:16',3),(2083,1066,'PS','en','<p>noun</p>','2015-04-07 18:23:10',3),(2084,1066,'DE','en','<p>The process of killing cells while preserving their structure and organization in as life like a condition as possible.</p>','2015-04-07 18:24:28',3),(2085,1066,'NA','en','<p>Not to be confused with \"nitrogen fixation\" or \"carbon fixation\".</p>','2015-04-07 18:24:41',3),(2086,1067,'ET','en','<p>from Greek, eutroph&iacute;a</p>','2015-04-07 18:27:11',3),(2087,1067,'PR','en','<p>/yuˈtrɒf ɪk/</p>','2015-04-07 18:28:39',3),(2088,1067,'PS','en','<p>adjective</p>','2015-04-07 18:29:13',3),(2089,1067,'DE','en','<p>characterized as being rich in nutrients, particularly those which support the growth of aerobic photosynthetic organisms (often a term applied to lakes, rivers, ponds, etc.).</p>','2015-04-07 18:29:52',3),(2090,1068,'ET','en','<p>Greek, combining ol&iacute;gos +&nbsp; trophik&oacute;s</p>','2015-04-07 18:31:53',3),(2091,1068,'PS','en','<p>adjective</p>','2015-04-07 18:32:22',3),(2092,1068,'DE','en','<p>characterized as being low in nutrients, particularly those which support the growth of aerobic photosynthetic organisms (often a term applied to lakes, rivers, ponds, etc.).</p>','2015-04-07 18:34:06',3),(2093,1068,'PR','en','<p>/ˌɒl ɪ goʊˈtrɒf ɪk/</p>','2015-04-07 18:34:47',3),(2094,1069,'ET','en','<p>from Greek auto and Latin clavis</p>','2015-04-07 18:47:24',3),(2095,1069,'PR','en','<p>/ˈɔ təˌkleɪv/</p>','2015-04-07 18:47:46',3),(2096,1069,'PS','en','<p>noun</p>','2015-04-07 18:48:22',3),(2097,1069,'DE','en','<p>an apparatus within which objects or materials can be sterilized by subjecting them to high pressure saturated steam at temperatures around 121&deg;C.</p>','2015-04-07 18:48:49',3),(2098,1070,'ET','en','<p>from New Latin, bacteria and Greek, phagos</p>','2015-04-07 18:52:18',3),(2099,1070,'PR','en','<p>/b&aelig;kˈtɪər i əˌfeɪdʒ/</p>','2015-04-07 18:52:50',3),(2100,1070,'PS','en','<p>noun</p>','2015-04-07 18:53:13',3),(2101,1070,'DE','en','<p>Any virus that can infect and replicate within a bacterial host.</p>','2015-04-07 18:53:34',3),(2102,1071,'ET','en','<p>from Greek, phagos</p>','2015-04-07 19:11:04',3),(2103,1071,'PR','en','<p>/feɪdʒ/</p>','2015-04-07 19:11:21',3),(2104,1071,'PS','en','<p>noun</p>','2015-04-07 19:17:54',3),(2105,1071,'NA','en','<p>an abbreviation for bacteriophage. See bacteriophage.</p>','2015-04-07 19:26:26',3),(2106,1072,'ET','en','<p>Neo-Latin, from&nbsp; Inul(a)</p>','2015-04-07 19:39:28',3),(2107,1072,'PR','en','<p>/ˈɪn yə lɪn/</p>','2015-04-07 19:44:32',3),(2108,1072,'PS','en','<p>noun</p>','2015-04-07 19:49:48',3),(2109,1072,'DE','en','<p>A naturally occurring linear polysaccharide used for storage in certain plants.</p>','2015-04-07 19:50:09',3),(2110,1073,'DE','en','<p>Any metal or metalloid of environmental concern (although this definition is not widely accepted). The term \"Heavy metals\" is often used to refer to metals of high density (Lead, Mercury, Cadmium, etc.) that are toxic to organisms. At higher concentrations, heavy metals may exhibit antimicrobial activity.</p>','2015-04-07 19:57:37',3),(2111,1074,'DE','en','<p>The region of soil which containts the root and is directly influenced by root secretions.</p>','2015-04-07 20:20:19',3),(2112,1074,'PS','en','<p>noun</p>','2015-04-07 20:19:20',3),(2113,1074,'PR','en','<p>/ˈraɪ zəˌsfɪər/</p>','2015-04-07 20:19:38',3),(2114,8,'NA','en','<p>synonymous with bacillus</p>','2015-04-08 14:08:45',3),(2115,9,'NA','en','<p>plural of rod, synonymous with bacilli</p>','2015-04-08 14:08:03',3),(2116,1076,'ET','en','<p>Middle English, from paire</p>','2015-04-08 14:43:13',3),(2117,1076,'PR','en','<p>/pɛər/</p>','2015-04-08 14:43:33',3),(2118,1076,'PS','en','<p>noun</p>','2015-04-08 14:43:48',3),(2119,1076,'DE','en','<p>made of two corresponding pieces, two objects matched together</p>','2015-04-08 14:44:15',3),(2120,1077,'ET','en','<p>Greek, from Greek tetrad</p>','2015-04-08 14:47:56',3),(2121,1077,'PR','en','<p>/ˈtɛtr&aelig;d/</p>','2015-04-08 14:48:17',3),(2122,1077,'PS','en','<p>noun</p>','2015-04-08 14:48:34',3),(2123,1077,'DE','en','<p>A group or arrangement of four</p>','2015-04-08 14:48:50',3),(2124,1078,'ET','en','<p>Old English, from clyster</p>','2015-04-08 14:52:36',3),(2125,1078,'PR','en','<p>/ˈklʌstər/</p>','2015-04-08 14:53:00',3),(2126,1078,'PS','en','<p>noun</p>','2015-04-08 14:55:12',3),(2127,1078,'DE','en','<p>A number of similar things occurring together</p>','2015-04-08 14:55:59',3),(2128,1079,'NA','en','<p>These terms are often used to refer to cells occurring together. However, these terms can also be used broadly.</p>','2015-04-08 15:28:04',3),(2129,1081,'ET','en','<p>Greek, from m&oacute;nos &amp; s&aacute;kkharon</p>','2015-04-08 17:03:01',3),(2130,1081,'PR','en','<p>/ˌmɒn əˈs&aelig;k əˌraɪd/</p>','2015-04-08 17:04:38',3),(2131,1081,'PS','en','<p>noun</p>','2015-04-08 17:03:31',3),(2132,1081,'DE','en','<p>The simplest form of carbohydrate. Sugars which are the most basic unit of more complex sugars and therefore, cannot be broken down into simpler sugars by hydrolysis.</p>','2015-04-08 17:04:25',3),(2133,1082,'ET','en','<p>Greek, from d&iacute;s &amp; s&aacute;kkharon</p>','2015-04-08 17:05:52',3),(2134,1082,'PR','en','<p>/daɪˈs&aelig;k əˌraɪd/</p>','2015-04-08 17:06:15',3),(2135,1082,'PS','en','<p>noun</p>','2015-04-08 17:06:45',3),(2136,1082,'DE','en','<p>A group of carbohydrates that upon hydrolysis yield two monosaccharides. Also, the product which is formed when two monosaccharides undergo a condensation reaction by the removal of water.</p>','2015-04-08 17:07:14',3),(2137,1083,'NB','en','<p>CHEBI:15936</p>\r\n<p>CID 644160</p>\r\n<p>KEGG compound:</p>\r\n<p>CAS number:</p>\r\n<p>InChI key: PYMYPHUHKUWMLA-VPENINKCSA-N</p>','2015-08-11 13:55:35',3),(2138,1084,'NB','en','<p><span class=\"text\"><span class=\"primary-text\">CHEBI:4139</span></span></p>\r\n<p><span class=\"text\"><span class=\"primary-text\">CID 6036</span></span></p>\r\n<p><span class=\"text\"><span class=\"primary-text\">KEGG compound: C00124<br /><br />CAS number: 59-23-4<br /><br />InChI key: WQZGKKKJIJFFOK-SVZMEOIVSA-N<br /></span></span></p>','2015-08-11 15:40:22',3),(2139,1085,'NB','en','<p>CHEBI:17925</p>\r\n<p>CID 79025</p>\r\n<p>KEGG compound:<br /><br />CAS number: 492-62-6<br /><br />InChI key: WQZGKKKJIJFFOK-DVKNGEFBSA-N</p>','2015-08-11 15:41:12',3),(2140,1086,'NB','en','<p>CHEBI:48095</p>\r\n<p>CID 5984</p>\r\n<p>KEGG compound: C10906<br /><br />CAS number: 57-48-7<br /><br />InChI key: BJHIKXHVCXFQLS-UYFOZJQFSA-N</p>','2015-08-11 15:43:49',3),(2141,1087,'NB','en','<p><span class