p>','2015-08-12 17:19:11',3),(2234,1191,'NB','en','<p>ATC code: J01</p>','2015-04-21 20:08:31',3),(2235,1192,'NB','en','<p>ATC code: J01A</p>','2015-04-21 20:24:54',3),(2236,1193,'NB','en','<p>ATC code: J01AA</p>','2015-04-21 20:34:03',3),(2237,1194,'NB','en','<p>ATC Code: J01AA01<br />CHEBI ID: CHEBI:4392<br />Drug Bank ID: CHEBI:4392<br />PubChem ID: CID 54680690<br />CAS Number: 127-33-3<br />KEGG DRUG: D03680<br />InChI Key: FMTDIUIBLCQGJB-SEYHBJAFSA-N</p>\r\n<p>Merck Index (tenth edition): #2858</p>','2015-10-15 18:34:45',3),(2240,1197,'PS','en','<p>noun</p>','2015-06-22 17:08:04',3),(2241,1197,'DE','en','<p>An amino acid which is not found in proteins but is present in the peptidoglycan cross link chains of many Gram negative bacteria.</p>','2015-06-22 17:08:20',3),(2242,1198,'PS','en','<p>noun</p>','2015-06-22 17:09:42',3),(2243,1198,'NA','en','<p>The abbreviation used for diaminopimelic acid, see diaminopimelic acid.</p>','2015-06-22 17:10:09',3),(2244,1199,'ET','en','<p>Greek &tau;&epsilon;ῖ&chi;&omicron;&sigmaf;, teīkhos, \"wall\"</p>','2015-06-22 17:14:35',3),(2245,1199,'PR','en','<p>\\tī-ˌkō-ik-\\</p>','2015-06-22 17:14:51',3),(2246,1199,'PS','en','<p>noun</p>','2015-06-22 17:15:20',3),(2247,1199,'DE','en','<p>Linear polymers (polysaccharides) which typically consist mainly of glycerol phosphate or ribitol phosphate linked by phosphodiester bonds. Teichoic acids occur (almost exclusively) in the cell envelope of most gram positive bacteria.</p>','2015-06-22 17:15:41',3),(2248,1200,'PS','en','<p>noun</p>','2015-06-22 17:17:16',3),(2249,1200,'DE','en','<p>A small lipoprotein which occurs in the outer membrane of some Gram negative bacteria. About one third of outer membrane Braun lipoprotein forms covalent linkages between the outer membrane and the peptidoglycan layer.</p>','2015-06-22 17:17:36',3),(2250,1201,'PS','en','<p>noun</p>','2015-06-22 17:18:47',3),(2251,1201,'NA','en','<p>the abbreviation used for Braun lipoprotein, see Braun lipoprotein.</p>','2015-06-22 17:19:00',3),(2252,1202,'PS','en','<p>noun</p>','2015-06-22 17:20:03',3),(2253,1202,'NA','en','<p>synonymous with Braun lipoprotein, use Braun lipoprotein.</p>','2015-06-22 17:20:15',3),(2254,1203,'PS','en','<p>noun</p>','2015-06-22 18:20:52',3),(2255,1203,'DE','en','<p>An ether of lactic acid and N-acetylglucosamine. One of the two alternating amino sugars which make up the structure of peptidoglycan (alternating units of N-acetylmuramic acid and N-acetylglucosamine). Additionally, lactic acid residues of N-acetylmuramic acid serve as sites of cross linking between adjacent peptidoglycan strands.</p>','2015-06-22 18:24:24',3),(2256,1204,'NA','en','<p>an abbreviation used for n-acetylmuramic acid, see n-acetylmuramic acid.</p>','2015-06-22 18:28:13',3),(2257,1204,'PS','en','<p>noun</p>','2015-06-22 18:28:27',3),(2258,1205,'NA','en','<p>an abbreviation used for n-acetylmuramic acid, see n-acetylmuramic acid.</p>','2015-06-22 18:30:17',3),(2259,1205,'PS','en','<p>noun</p>','2015-06-22 18:30:32',3),(2260,1091,'DE','en','<p>A monosaccharide derivative of glucosamine. One of the two alternating amino sugars which make up the structure of peptidoglycan (alternating units of N-acetylglucosamine and N-acetylmuramic acid). In fungal cell walls N-acetylglucosamine makes up the polymer chitin.</p>','2015-06-22 18:58:01',3),(2261,1206,'PS','en','<p>noun</p>','2015-06-22 18:58:52',3),(2262,1206,'NA','en','<p>an abbreviation used for n-acetylglucosamine, see n-acetylglucosamine.</p>','2015-06-22 18:59:07',3),(2263,1207,'PS','en','<p>noun</p>','2015-06-22 19:00:14',3),(2264,1207,'NA','en','<p>an abbreviation used for n-acetylglucosamine, see n-acetylglucosamine.</p>','2015-06-22 19:00:29',3),(2265,1208,'ET','en','<p>French, from chitine</p>','2015-06-22 19:01:50',3),(2266,1208,'PR','en','<p>/ˈkaɪ tɪn/</p>','2015-06-22 19:02:02',3),(2267,1208,'PS','en','<p>noun</p>','2015-06-22 19:02:17',3),(2268,1208,'DE','en','<p>A linear polysaccharide composed of repeating units of N-acetylglucosamine. Chitin occurs naturally in fungal cell walls, the shells and exoskeletons of some animals, and others.</p>','2015-06-22 19:02:32',3),(2269,1209,'PS','en','<p>noun</p>','2015-06-22 19:04:31',3),(2270,1209,'DE','en','<p>Proteins which are synthesized at increased levels in an organism in response to a sudden rise in temperature or an increase in other types of stress (such as UV radiation and high chemical concentration such as ethanol). Many heat shock proteins preform a chaperone function; helping to refold partially denatured proteins. Heat shock proteins also include proteases which help degrade irreversibly damaged proteins.</p>','2015-06-22 19:04:45',3),(2271,1210,'PS','en','<p>noun</p>','2015-06-22 19:07:32',3),(2272,1210,'NA','en','<p>The abbreviation used for heat shock protein, see heat shock protein.</p>','2015-06-22 19:07:51',3),(2273,1211,'ET','en','<p>Latin, from mōlē + -cula &amp; Middle French, equivalent to chape + -eron</p>','2015-06-22 19:26:11',3),(2274,1211,'PR','en','<p>/məˈlɛk yə lər ˈʃ&aelig;p əˌroʊn/</p>','2015-06-22 19:26:27',3),(2275,1211,'DE','en','<p>A protein that helps fold unfolded proteins or helps refold partially denatured proteins back to an active protein.</p>','2015-06-22 19:28:50',3),(2276,1212,'ET','en','<p>Middle French, equivalent to chape + -eron</p>','2015-06-22 19:32:13',3),(2277,1212,'PR','en','<p>/ˈʃ&aelig;p əˌroʊn/</p>','2015-06-22 19:32:25',3),(2278,1212,'PS','en','<p>noun</p>','2015-06-22 19:32:42',3),(2279,1212,'NA','en','<p>see molecular chaperone</p>','2015-06-22 19:32:55',3),(2280,1213,'ET','en','<p>Medieval Latin, from prīmārium</p>','2015-06-22 20:00:07',3),(2281,1213,'PR','en','<p>/ˈprɪm ər/</p>','2015-06-22 20:00:29',3),(2282,1213,'PS','en','<p>noun</p>','2015-06-22 20:00:43',3),(2283,1213,'DE','en','<p>A short strand of nucleic acid used to initiate synthesis of a new DNA strand.</p>','2015-06-22 20:00:59',3),(2284,1214,'ET','en','<p>Greek, from ēlektron &amp; ph&oacute;rēsis</p>','2015-06-22 20:08:43',3),(2285,1214,'PR','en','<p>/ɪˌlɛk troʊ fəˈri sɪs/</p>','2015-06-22 20:09:03',3),(2286,1214,'PS','en','<p>noun</p>','2015-06-22 20:09:22',3),(2287,1214,'DE','en','<p>The separation of charged particles by means of their dissimilar migration characteristics in a uniform electric field. Various types of electrophoresis separate particles based on charge, size, or binding affinity.</p>','2015-06-22 20:11:33',3),(2288,1215,'ET','en','<p>Greek from khrōma &amp; s&ocirc;ma</p>','2015-06-22 20:29:22',3),(2289,1215,'PR','en','<p>/ˈkroʊ məˌsoʊm/</p>','2015-06-22 20:29:46',3),(2290,1215,'PS','en','<p>noun</p>','2015-06-22 20:30:06',3),(2291,1215,'DE','en','<p>Organized structures which contain or consist of DNA which carry genetic information essential to the cell.&nbsp; Prokaryotes typically have one a single circular chromosome while eukaryotes typically have several linear chromosomes all located inside a nucleus. The term chromosome is also used to describe the DNA in mitochondria and chloroplasts.</p>','2015-06-22 20:30:31',3),(2292,1216,'ET','en','<p>Latin, from dē- or dis- &amp; nātūra</p>','2015-06-22 20:36:47',3),(2293,1216,'PS','en','<p>noun</p>','2015-06-22 20:37:05',3),(2294,1216,'DE','en','<p>The alteration of a protein\'s or nucleic acid\'s shape such that it is no longer biologically active. More specifically, the loss of a macromolecule\'s secondary, tertiary, and quaternary structure by environmental stress (heat, radiation, strong acid or base, salt concentration, solvents, etc.).</p>','2015-06-22 20:37:38',3),(2295,1195,'DE','en','<p>The acquired ability of a microorganism to grow in the presence of an antimicrobial agent that it is usually susceptible to.</p>','2015-06-24 17:08:52',3),(2296,1195,'PS','en','<p>noun</p>','2015-06-24 17:09:12',3),(2297,1217,'PS','en','<p>noun</p>','2015-06-24 18:17:16',3),(2298,1217,'DE','en','<p>The lowest concentration of a given antibiotic which inhibits a given type of microorganism under given conditions.</p>','2015-06-24 18:17:35',3),(2299,1218,'NA','en','<p>The abbreviation used for minimum inhibitory concentration, see minimum inhibitory concentration.</p>','2015-06-24 18:20:18',3),(2300,1219,'DE','en','<p>The susceptibility of a microorganism to an antimicrobial agent (a microorganism\'s growth being prevented by the presence of an antimicrobial agent).</p>','2015-06-24 19:08:25',3),(2301,1219,'PS','en','<p>noun</p>','2015-06-24 19:08:55',3),(2302,1220,'DE','en','<p>Any entity (a single cell, chain of cells, etc.) capable of giving rise to a single colony. Colony forming units per unit volume (or per unit area) is a unit often used to estimate the number of viable cells in a sample.</p>','2015-06-24 20:01:31',3),(2303,1220,'PS','en','<p>noun</p>','2015-06-24 20:02:07',3),(2304,1221,'PS','en','<p>noun</p>','2015-06-24 20:02:49',3),(2305,1221,'NA','en','<p>The abbreviation used for colony forming unit, see colony forming unit.</p>','2015-06-24 20:03:01',3),(2306,1222,'PR','en','<p>(bī\'ō-fĭlm\')</p>','2015-06-25 16:44:53',3),(2307,1222,'PS','en','<p>noun</p>','2015-06-25 16:45:08',3),(2308,1222,'DE','en','<p>A film of microorganisms which are usually embedded in self produced extracellular polymers. Biofilm adheres to surfaces, particularly those that are exposed to an aquatic environment. Biofilm typically has slimy characteristics. Examples include dental plaque and algal mats.</p>','2015-06-25 16:45:26',3),(2309,1223,'DE','en','<p>The dry weight (or some other estimation) of all organisms in a given habitat.</p>','2015-06-25 19:33:51',3),(2310,1223,'PR','en','<p>/ˈbaɪ oʊˌm&aelig;s/</p>','2015-06-25 19:34:05',3),(2311,1223,'ET','en','<p>Greek, from b&iacute;os &amp; m&acirc;za</p>','2015-06-25 19:34:21',3),(2312,1223,'PS','en','<p>noun</p>','2015-06-25 19:35:03',3),(2313,929,'NB','en','<p>ATC Code: J01FA01<br />CHEBI ID: CHEBI:42355<br />Drug Bank ID: DB00199<br />PubChem ID: CID 12560<br />CAS Number: 114-07-8<br />KEGG DRUG: D00140<br />InChI Key: ULGZDMOVFRHVEP-