',3),(2588,1497,'NB','en','<p>CHEBI:48455</p>\r\n<p>CID 5376004</p>\r\n<p>MetaCyc: DEMETHYLMENAQUINONE</p>\r\n<p>CAS number: 29790-47-4</p>\r\n<p>InChI key: GDUBPWSFXUAETN-AENDIINCSA-N</p>','2015-08-14 20:00:09',3),(2589,1498,'NB','en','<p>CID 25245235</p>\r\n<p>MetaCyc: CPD-9733</p>\r\n<p>InChI key: MZHQKWYODJVUBB-RNFPTGGASA-N</p>','2015-08-14 20:23:56',3),(2590,1499,'ET','en','<p>Greek, from biotḗ + -in</p>','2015-10-09 14:38:01',3),(2591,1499,'PR','en','<p>/ˈbaɪ ə tɪn/</p>','2015-10-09 14:38:12',3),(2592,1499,'PS','en','<p>noun</p>','2015-10-09 14:38:25',3),(2593,1499,'DE','en','<p>A vitamin which acts as a cofactor in carboxylation and transcarboxylation reactions acting as a carrier of CO2 in several carboxylase enzymes. Biotin is required as a growth factor for many bacteria.</p>','2015-10-09 14:39:15',3),(2594,1501,'PS','en','<p>noun</p>','2015-10-09 14:40:56',3),(2595,1501,'DE','en','<p>Synonym of biotin. See biotin</p>','2015-10-09 14:41:57',3),(2596,1500,'DE','en','<p>Synonym of biotin. See biotin.</p>','2015-10-09 14:42:20',3),(2597,1500,'PS','en','<p>noun</p>','2015-10-09 14:42:35',3),(2598,1502,'PS','en','<p>noun</p>','2015-10-09 15:20:36',3),(2599,1502,'DE','en','<p>A linear polymer of beta hydroxybutyrate which occurs in refractile granules within cells of various prokaryotes. See Poly-&beta;-hydroxybutyrate Granules.</p>','2015-10-09 15:20:58',3),(2600,1503,'DE','en','<p>A refractile granule which is an accumulation of Poly-&beta;-hydroxybutyrate (PHB). PHB accumulates in various prokaryotes when nutrients other than carbon sources become limiting.&nbsp; PHB accumulations are then degraded by the cell when carbon sources are limiting,&nbsp; therefore acting as a reservoir of carbon and/or energy.</p>','2015-10-09 15:22:23',3),(2601,1503,'PS','en','<p>noun</p>','2015-10-09 15:22:42',3),(2602,1504,'DE','en','<p>acronym for Poly-&beta;-hydroxybutyrate.</p>','2015-10-09 15:25:01',3),(2603,1505,'DE','en','<p>See Poly-&beta;-hydroxybutyrate Granules.</p>','2015-10-09 15:26:51',3),(2604,1507,'PS','en','<p>noun</p>','2015-10-09 16:20:04',3),(2605,1507,'DE','en','<p>Intracellular, membranous, vesicles formed in green sulfur bacteria which act as photosynthetic antenna complexes (light-harvesting complexes). Chlorosomes contain most of the light harvesting pigments involved in photosynthesis.</p>','2015-10-09 16:20:19',3),(2606,1508,'NA','en','<p>see chlorosome</p>','2015-10-09 16:21:09',3),(2607,1509,'PS','en','<p>noun</p>','2015-10-09 16:53:55',3),(2608,1509,'DE','en','<p>A type of (often intracellular) storage inclusion which contains sulfur compounds. Sulfur globules are found in a diverse group of sulfur utilizing prokaryotes.</p>','2015-10-09 16:55:35',3),(2609,1510,'PS','en','<p>noun</p>','2015-10-09 18:44:14',3),(2610,1510,'ET','en','<p>Greek, from glyk&yacute;s + genēs. Latin, from grānulum</p>','2015-10-09 18:44:33',3),(2611,1510,'PR','en','<p>/ˈglaɪ kə dʒən ˈgr&aelig;n yul/</p>','2015-10-09 18:44:44',3),(2612,1510,'PS','en','<p>an intracellular inclusion which consists of an accumulation of the storage polysaccharide glycogen.</p>','2015-10-09 18:45:03',3),(2613,1511,'PS','en','<p>noun</p>','2015-10-09 18:46:36',3),(2614,1511,'PR','en','<p>/ˈglaɪ kə dʒən/</p>','2015-10-09 18:46:48',3),(2615,1511,'ET','en','<p>Greek, from glyk&yacute;s + genēs</p>','2015-10-09 18:47:01',3),(2616,1511,'DE','en','<p>A multibranched polysaccharide composed of glucose linked together by &alpha; glycosidic bonds.</p>','2015-10-09 18:47:19',3),(2617,1512,'DE','en','<p>A semi-quantitative, commercial method used to detect enzymatic activities</p>','2015-10-09 19:37:51',3),(2618,1512,'NB','en','<p>&reg;</p>','2015-10-09 19:42:11',3),(2619,1520,'NB','en','<p>EC number: <span class=\"header pageTitle\">EC 3.4.21.4</span></p>\r\n<p>CAS: 9002-07-7</p>','2015-10-09 19:54:44',3),(2621,1520,'DE','en','<p>A serine protease which is found in a diverse set of organisms.</p>','2015-10-12 13:57:03',3),(2622,161,'DE','en','<p>pertaining to sheathed bacteria; a secreted tubular structure formed around a chain of cells or around a bundle of filaments.</p>','2015-10-12 14:32:40',3),(2623,161,'DE','en','<p>pertaining to flagellar sheath; a layer of outer membrane covering the flagellum.</p>','2015-10-12 14:32:59',3),(2624,161,'PS','en','<p>noun</p>','2015-10-12 14:33:24',3),(2625,161,'PR','en','<p>/ʃi&theta;/</p>','2015-10-12 14:33:37',3),(2626,161,'ET','en','<p>Old English, from scēath</p>','2015-10-12 14:34:14',3),(2627,1530,'PR','en','<p>/ɛs ˈleɪ ər/</p>','2015-10-12 15:25:09',3),(2628,1530,'PS','en','<p>noun</p>','2015-10-12 15:25:20',3),(2629,1530,'DE','en','<p>A structure found in both bacteria and archaea which is usually the outermost layer of the cell. The S layer encloses the entire cell surface and consists of a repeating pattern of protein or glycoprotein subunits.</p>','2015-10-12 15:25:38',3),(2630,1531,'NA','en','<p>Full form of the term S-layer</p>','2015-10-12 15:27:37',3),(2631,1532,'NA','en','<p>See S-layer</p>','2015-10-12 15:28:23',3),(2632,1534,'DE','en','<p>a narrow extension of a bacterial cell including the plasma membrane and cell wall. Prosthecae can also be short and conical, branched or unbranched, or involved in reproduction.</p>','2015-10-12 16:25:26',3),(2633,1534,'PS','en','<p>noun</p>','2015-10-12 16:25:43',3),(2634,1534,'ET','en','<p>/&prime;pros-the\'kah/</p>','2015-10-12 16:26:02',3),(2635,1535,'DE','en','<p>Not to be confused with S-layer. A layer of diffuse secretions which may adhere loosely to the cell surface. Slime layers mostly consist of unorganized polysaccharide lying outside the bacterial cell wall.</p>','2015-10-12 17:04:36',3),(2636,1535,'PR','en','<p>/slaɪm ˈleɪ ər/</p>','2015-10-12 17:05:33',3),(2637,1535,'PS','en','<p>noun</p>','2015-10-12 17:05:44',3),(2638,1521,'NB','en','<p>EC number: EC 3.4.21.1</p>\r\n<p>CAS number: 9004-07-3</p>','2015-10-12 17:11:06',3),(2639,1522,'NB','en','<p>EC number: EC 3.1.3.2</p>\r\n<p>CAS number: 9001-77-8</p>','2015-10-12 17:14:22',3),(2640,1513,'NB','en','<p>EC number: EC 3.1.3.1</p>\r\n<p>CAS number: 9001-78-9</p>','2015-10-12 17:18:46',3),(2641,1529,'NB','en','<p>EC number: EC 3.2.1.51</p>\r\n<p>CAS: 9037-65-4</p>','2015-10-12 18:15:01',3),(2642,1528,'NB','en','<p>EC number: EC 3.2.1.24</p>\r\n<p>CAS: 9025-42-7</p>','2015-10-12 18:22:19',3),(2643,1526,'NB','en','<p>EC number:&nbsp;3.2.1.20</p>\r\n<p>CAS: 9001-42-7</p>','2015-10-12 18:39:10',3),(2644,1525,'NB','en','<p>EC number: EC 3.2.1.21<span class=\"header pageTitle\"><br /></span></p>\r\n<p>CAS: 9001-22-3</p>','2015-10-12 18:47:06',3),(2645,555,'NB','en','<p>EC number: <span class=\"header pageTitle\">EC 3.2.1.23</span></p>\r\n<p>CAS: 9031-11-2</p>','2015-10-12 18:56:52',3),(2646,1524,'NB','en','<p>EC number: EC 3.2.1.22</p>\r\n<p>CAS: 9025-35-8</p>','2015-10-12 19:02:02',3),(2648,1523,'NB','en','<p>EC number: EC 3.9.1.1<span class=\"header pageTitle\"><br /></span></p>\r\n<p>CAS: 9001-79-0</p>','2015-10-12 19:08:58',3),(2649,1536,'NA','en','<p>See haemolysis.</p>','2015-10-13 15:29:13',3),(2650,1536,'PR','en','<p>/hɪˈmɒlɪsɪs/</p>','2015-10-13 15:29:38',3),(2651,1537,'PR','en','<p>/hɪˈmɒlɪsɪs/</p>','2015-10-13 15:30:22',3),(2652,1537,'PS','en','<p>noun</p>','2015-10-13 15:30:50',3),(2653,1536,'PS','en','<p>noun</p>','2015-10-13 15:31:04',3),(2654,1537,'DE','en','<p>The lysis of erythrocytes. Haemolysis is often detected by growing microorganisms on agar with added erythrocytes (see blood agar). There are several types of heamolytic reactions which can occur (see &alpha;-haemolysis, &beta;-haemolysis, &gamma;-haemolysis).</p>','2015-10-13 15:32:36',3),(2655,1538,'DE','en','<p>A type of haemolysis which is identifiable by the formation of a zone of opaque green around colonies of an organism when grown on blood agar. This reaction signifies partial lysis of erythrocytes.</p>','2015-10-13 15:36:08',3),(2656,1538,'PS','en','<p>noun</p>','2015-10-13 15:35:01',3),(2657,1539,'DE','en','<p>A type of haemolysis which is identifiable by the formation of a differentiated zone of clearing (colorless zone) around colonies of an organism when grown on blood agar. This reaction signifies total lysis of erythrocytes.</p>','2015-10-13 15:37:19',3),(2658,1539,'PS','en','<p>noun</p>','2015-10-13 15:37:31',3),(2659,1540,'DE','en','<p>The absence of haemolysis.</p>','2015-10-13 15:39:16',3),(2660,1540,'PS','en','<p>noun</p>','2015-10-13 15:39:29',3),(2661,1541,'ET','en','<p>Old English, from grēne -ing</p>','2015-10-13 15:45:42',3),(2662,1541,'PR','en','<p>/ˈgri nɪŋ/</p>','2015-10-13 15:45:55',3),(2663,1541,'PS','en','<p>noun</p>','2015-10-13 15:46:11',3),(2664,1541,'DE','en','<p>Pertaining to a reaction observed on blood agar. The formation of a opaque green zone around colonies. synonymous to &alpha;-heamolysis.</p>','2015-10-13 15:48:00',3),(2665,1542,'PS','en','<p>noun</p>','2015-10-13 15:49:21',3),(2666,1542,'DE','en','<p>Any agar based growth medium containing blood.</p>','2015-10-13 15:50:12',3),(2667,1543,'ET','en','<p>Greek, from sakkharon and lusis</p>','2015-10-13 16:22:12',3),(2668,1543,'PR','en','<p>/ˌs&aelig;k ə roʊˈlɪt ɪk/</p>','2015-10-13 16:22:44',3),(2669,1543,'PS','en','<p>adjective</p>','2015-10-13 16:23:01',3),(2670,1543,'DE','en','<p>Of or causing the hydrolysis of carbohydrates.</p>','2015-10-13 16:23:25',3),(2671,1544,'ET','en','<p>Greek, from khēmeia and French, from taxonomie</p>','2015-10-13 17:07:11',3),(2672,1544,'PR','en','<p>/ˌki moʊ t&aelig;kˈsɒn ə mi/</p>','2015-10-13 17:08:11',3),(2673,1544,'PS','en','<p>noun</p>','2015-10-13 17:08:24',3),(2674,1544,'DE','en','<p>Taxonomy which is based upon comparative analysis of the biochemical composition of organisms (such as 16s RNA structure, DNA base ratio, cell wall lipid content, etc.)</p>','2015-10-13 17:08:48',3),(2675,1545,'ET','en','<p>French, from taxonomie</p>','2015-10-13 17:09:39',3),(2676,1545,'PR','en','<p>/t&aelig;kˈsɒn ə mi/</p>','2015-10-13 17:09:57',3),(2677,1545,'PS','en','<p>noun</p>','2015-10-13 17:10:15',3),(2678,1545,'DE','en','<p>The science of biological classification and the grouping of organisms based upon their similarities. Taxonomy consists of three parts: identification, classification, and nomenclature.</p>','2015-10-13 17:11:05',3),(2679,1546,'PR','en','<p>/ˈspɜr min/</p>','2015-10-13 18:55:35',3),(2680,1546,'PS','en','<p>noun</p>','2015-10-13 18:55:46',3),(2681,1546,'DE','en','<p>A polyamine which is present in almost all prokaryotic and eukaryotic cells. [NH2(CH2)3NH(CH2)4NH(CH2)3NH2]</p>','2015-10-13 18:59:19',3),(2682,1546,'NB','en','<p>CHEBI: 15746</p>\r\n<p>CID 1103</p>\r\n<p>KEGG compound: C00750<code></code><br /><br />CAS number: 71-44-3<br /><br />InChI key: PFNFFQXMRSDOHW-UHFFFAOYSA-N</p>','2015-10-13 19:06:15',3),(2683,1547,'PR','en','<p>/ˈspɜr mɪˌdin/</p>','2015-10-13 19:13:06',3),(2684,1547,'PS','en','<p>noun</p>','2015-10-13 19:13:17',3),(2685,1547,'DE','en','<p>A polyamine which is present in almost all prokaryotic and eukaryotic cells. [H2N(CH2)4NH(CH2)3NH2]</p>','2015-10-13 19:13:34',3),(2686,1547,'NB','en','<p>CHEBI: 16610</p>\r\n<p>CID <span class=\"text\"><span class=\"primary-text\">1102</span></span></p>\r\n<p>KEGG compound: C00315<br /><br />CAS number: 124-20-9<br /><br />InChI key: ATHGHQPFGPMSJY-UHFFFAOYSA-N</p>','2015-10-13 19:17:40',3),(2687,1548,'PR','en','<p>/pjuːˈtrɛsiːn/</p>','2015-10-13 19:27:07',3),(2688,1548,'PS','en','<p>noun</p>','2015-10-13 19:27:21',3),(2689,1548,'DE','en','<p>A polyamine which is present in almost all prokaryotic and eukaryotic cells. [NH2(CH2)4NH2]</p>','2015-10-13 19:27:40',3),(2690,1548,'NB','en','<p>CHEBI: 17148</p>\r\n<p>CID 1045</p>\r\n<p>KEGG compound: C00134<br /><br />CAS number: 110-60-1<br /><br />InChI key: KIDHWZJUCRJVML-UHFFFAOYSA-N</p>','2015-10-13 19:32:53',3),(2691,1549,'NB','en','<p>CHEBI: 18127</p>\r\n<p>CID 273</p>\r\n<p>KEGG compound: C01672<code></code><br /><br />CAS number: 462-94-2<br /><br />InChI key: VHRGRCVQAFMJIZ-UHFFFAOYSA-N</p>','2015-10-13 19:50:20',3),(2692,1549,'PR','en','<p>/kəˈd&aelig;v əˌrin/</p>','2015-10-13 20:03:21',3),(2693,1549,'PS','en','<p>noun</p>','2015-10-13 20:03:35',3),(2694,1549,'DE','en','<p>A polyamine [NH<sub>2</sub>(CH<sub>2</sub>)<sub>5</sub>NH<sub>2</sub>]</p>','2015-10-13 20:27:02',3),(2695,1550,'NB','en','<p>CHEBI: 16554</p>\r\n<p>CID 368</p>\r\n<p>KEGG compound: C06366<br /><br />CAS number: 4427-76-3<br /><br />InChI key: UODZHRGDSPLRMD-UHFFFAOYSA-N</p>','2015-10-13 20:43:09',3),(2696,1551,'PR','en','<p>/ˈtɛl yəˌraɪt/</p>','2015-10-14 16:01:37',3),(2697,1551,'PS','en','<p>noun</p>','2015-10-14 16:01:47',3),(2698,1551,'DE','en','<p>[TeO<sub>3</sub><sup>2&minus;</sup>]. An ion which is inhibitory to some bacteria. Tellurite is added to growth media to select for resistant bacteria (<em>Corynebacteria for example</em>).</p>','2015-10-14 16:04:43',3),(2699,1552,'PR','en','<p>/ˈsaɪ əˌnaɪd tɛst/</p>','2015-10-14 16:05:26',3),(2700,1552,'PS','en','<p>noun</p>','2015-10-14 16:05:35',3),(2701,1552,'DE','en','<p>A test used to determine if an organism is able to grow in the presence of cyanide (usually KCN).</p>','2015-10-14 16:05:50',3),(2702,1553,'PR','en','<p>/mɛˈ&theta;&aelig;n ə dʒən/</p>','2015-10-14 16:07:43',3),(2703,1553,'PS','en','<p>noun</p>','2015-10-14 16:07:54',3),(2704,1553,'DE','en','<p>Any microorganism capable of methanogenesis. All known methanogens are archaea and are generally strict anaerobes. Methanogens are common in mud and wetland habitats and in the digestive tracts of ruminants and humans. Many methanogens only growth with simple substrates such as CO2/H2, acetate, methanol, and methylamines.</p>','2015-10-14 16:08:16',3),(2705,1554,'PS','en','<p>noun</p>','2015-10-14 16:09:19',3),(2706,1554,'DE','en','<p>The formation of methane (<span class=\"chemf\" style=\"white-space: nowrap;\">CH<sub>4</sub></span>) which is carried out as an end product of an energy yielding process by certain archaea.</p>','2015-10-14 16:10:12',3),(2707,1555,'PS','en','<p>noun</p>','2015-10-14 16:11:16',3),(2708,1555,'DE','en','<p>Any microorganism capable of methanotrophy. That is to say, any microorganism capable of methane as a sole source of carbon and energy.</p>','2015-10-14 16:11:57',3),(2709,1556,'DE','en','<p>The use of methane as a sole source of carbon and energy. Not to be confused with methylotrophy which referes to use of any one carbon compound as a sole carbon and energy source.</p>','2015-10-14 16:12:38',3),(2710,1556,'PS','en','<p>noun</p>','2015-10-14 16:13:01',3),(2711,1557,'PS','en','<p>noun</p>','2015-10-14 16:13:35',3),(2712,1557,'DE','en','<p>Any microorganism capable of methylotrophy. That is to say, any microorganism capable of using one carbon compounds as a sole source of carbon and energy.</p>','2015-10-14 16:13:47',3),(2713,1558,'PS','en','<p>noun</p>','2015-10-14 16:15:58',3),(2714,1558,'DE','en','<p>The use of one carbon compounds as a sole source of carbon and energy. Not to be confused with methanotrophy which is a type of methylotrophy (see methanotrophy).</p>','2015-10-14 16:16:31',3),(2715,1559,'NB','en','<p>EC number: EC 3.2.1.17</p>\r\n<p>CAS number: 9001-63-2</p>','2015-10-14 16:31:31',3),(2716,1560,'NA','en','<p>See lysozyme</p>','2015-10-14 16:34:25',3),(2717,1559,'PR','en','<p>/ˈlaɪ səˌzaɪm/</p>','2015-10-14 16:48:15',3),(2718,1559,'PS','en','<p>noun</p>','2015-10-14 16:48:26',3),(2719,1559,'DE','en','<p>An enzyme which hydrolyses the (1&rarr;4)-&beta;-linkages between N-acetylmuramic acid and N-acetylglucosamine in peptidoglycan. Lysozyme can therefore cause lysis of cells whose peptidoglycan is accessible to enzyme action. Lysozyme is found in the secretions of animals and in certain plants.</p>','2015-10-14 16:48:41',3),(2720,1561,'PS','en','<p>noun</p>','2015-10-14 18:17:03',3),(2721,1561,'DE','en','<p>Polyene pigments found in members of the Cytophagales. Flexirubin type pigments are the main pigment found in members of the genus Flexibacter.</p>','2015-10-14 18:17:18',3),(2722,1562,'DE','en','<p>A bifunctional enzyme which catalyzes the first major step of the Calvin cycle (carbon fixation). RuBisCO is estimated to be the most abundant enzyme on earth.</p>','2015-10-14 18:51:51',3),(2723,1562,'PS','en','<p>noun</p>','2015-10-14 18:52:09',3),(2724,1563,'DE','en','<p>The full name of the enzyme RuBisCo</p>','2015-10-14 18:53:17',3),(2725,1563,'NA','en','<p>See RuBisCo</p>','2015-10-14 18:53:38',3),(2726,1564,'NB','en','<p>CHEBI: 15940</p>\r\n<p>CID 938</p>\r\n<p>KEGG drug: D00049<br /><br />CAS number: 59-67-6<br /><br />InChI key: PVNIIMVLHYAWGP-UHFFFAOYSA-N</p>','2015-10-14 19:09:09',3),(2727,1565,'NA','en','<p>See nicotinic acid</p>','2015-10-14 19:11:12',3),(2728,1566,'ET','en','<p>Latin, from fastīdiōsus</p>','2015-10-14 19:26:46',3),(2729,1566,'PR','en','<p>/f&aelig;ˈstɪd i əs/</p>','2015-10-14 19:26:57',3),(2730,1566,'PS','en','<p>adjective</p>','2015-10-14 19:27:07',3),(2731,1566,'DE','en','<p>A broad term used to describe any organism which has complex nutritional requirements. Often used to refer to organisms which can only be cultured if complex nutrients (such as yeast extract, blood, vitamins, etc.) are added to culture media.</p>','2015-10-14 19:27:19',3),(2732,1567,'PS','en','<p>adjective</p>','2015-10-14 20:11:35',3),(2733,545,'PS','en','<p>noun</p>','2015-10-14 20:11:55',3),(2734,1568,'DE','en','<p>Any fermentation in which there is only one major end product.</p>','2015-10-14 20:23:13',3),(2735,1568,'PS','en','<p>noun</p>','2015-10-14 20:23:33',3),(2736,1569,'PS','en','<p>noun</p>','2015-10-14 20:23:58',3),(2737,1569,'DE','en','<p>Any fermentation in which there is more than one major end product.</p>','2015-10-14 20:24:10',3),(2738,1570,'DE','en','<p>denoting a geometric isomer having a pair of identical atoms or groups attached on the same side of two atoms linked by a double bond.</p>','2015-10-14 20:25:30',3),(2739,1571,'DE','en','<p>denoting a geometric isomer having a pair of identical atoms or groups on the opposite sides of two atoms linked by a double bond.</p>','2015-