ade name of <a title=\"see details from nitrofurantoin\" href=\"index.php?tema=1371\">nitrofurantoin</a></p>','2015-10-16 14:45:09',3),(2812,1645,'NA','en','<p>See <a title=\"see details from fosfomycin\" href=\"index.php?tema=1374\">fosfomycin</a></p>','2015-10-16 14:46:03',3),(2813,1646,'DE','en','<p>CHEBI:23414</p>\r\n<p>CuSO<sub>4<br /></sub></p>','2015-10-16 14:48:53',3),(2814,1647,'NB','en','<p>CHEBI ID: CHEBI:87184<br />Drug Bank ID: DB03808<br />PubChem ID: CID 65130<br />CAS Number: 3811-75-4<br />KEGG DRUG: D07206<br />InChI Key: OQLKNTOKMBVBKV-UHFFFAOYSA-N</p>','2015-10-16 15:18:15',3),(2815,1648,'NB','en','<p>CHEBI ID: CHEBI:3020<br />CAS Number: 8001-54-5<br />KEGG DRUG: D00857</p>','2015-10-16 15:20:35',3),(2816,1649,'NB','en','<p>CHEBI ID: CHEBI:87175<br />PubChem ID: CID 67413<br />CAS Number: 140-63-6<br />KEGG DRUG: D08436<br />InChI Key: WSOSYBUSMXEYDO-UHFFFAOYSA-N</p>','2015-10-16 15:31:10',3),(2817,1650,'NA','en','<p>See <a title=\"see details from Propamidine isetionate\" href=\"index.php?tema=1649\">Propamidine isetionate</a></p>','2015-10-16 15:32:04',3),(2818,1651,'PS','en','<p>adjective</p>','2015-10-16 15:56:03',3),(2819,1651,'PR','en','<p>/ˈfyu zəˌfɔrm/</p>','2015-10-16 15:56:13',3),(2820,1651,'ET','en','<p>Latin, from&nbsp; fūs(us)</p>','2015-10-16 15:56:26',3),(2821,1651,'DE','en','<p>Spindle shaped, having tapered ends.</p>','2015-10-16 15:56:42',3),(2822,1651,'NA','en','<p>A term which can be used to describe the shape of a cell, colony, or other morphological feature.</p>','2015-10-16 15:57:53',3),(2824,1652,'NA','en','<p>Cell shape: see <a title=\"see details from coccus\" href=\"index.php?tema=1\">coccus</a>.</p>','2015-10-16 16:04:13',3),(2825,1652,'ET','en','<p>Latin, from sphaera</p>','2015-10-16 16:04:42',3),(2826,606,'NA','en','<p>Cell shape: see <a title=\"see details from filamentous\" href=\"index.php?tema=14\">filamentous</a></p>','2015-10-16 16:12:23',3),(2827,1653,'DE','en','<p>a rigid spiral shaped cell. Spirillum cells are often a long rod or filament shape (length much greater than width) which is spiraled into a repeated waveform. Not to be confused with the \"spirochete\" morphology which is comprised of flexible spiral shapes. Not to be confused with \"Spirillum\" (representing the taxon).</p>','2015-10-16 16:13:53',3),(2828,1654,'DE','en','<p>a flexible spiral shaped cell with periplasmic flagella. Spirochete cells are often a long rod or filament shape (length much greater than width) which is spiraled into a repeated waveform. Not to be confused with the \"spirillum\" morphology which is comprised of rigid spiral shapes. Not to be confused with \"Spirochaete\" or \"Spirochete\" (representing the taxon).</p>','2015-10-16 16:15:56',3),(2829,236,'NA','en','<p>Cell shape: see spirillum and spirochete</p>','2015-10-16 16:17:32',3),(2830,1655,'DE','en','<p>An uncommon cellular morphology. Cells which exhibit a square or cubical shape. Example Haloquadratum Walsbyi</p>','2015-10-16 16:25:45',3),(2831,1655,'PR','en','<p>/skwɛər/</p>','2015-10-16 16:27:53',3),(2832,1655,'PS','en','<p>noun</p>\r\n<p>adjective</p>','2015-10-16 16:28:18',3),(2833,1656,'PR','en','<p>/ˈsɑrsənə/</p>','2015-10-16 17:32:11',3),(2834,1656,'PS','en','<p>noun</p>','2015-10-16 17:32:24',3),(2835,1656,'ET','en','<p>Neo-Latin, Latin:&nbsp; bundle</p>','2015-10-16 17:32:35',3),(2836,1656,'DE','en','<p>Pertaining to an arrangement of cocci. Cocci arranged in a 2x2x2 cube (8 cells total). Larger arrangements are also possible (4x4x4). Not to be confused with \"Sarcina\" representing the taxon.</p>','2015-10-16 17:32:52',3),(2837,1658,'PS','en','<p>noun</p>','2015-10-16 19:18:08',3),(2838,1658,'DE','en','<p>An acid-fast stain in which a heat fixed smear is flooded with carbolfuchsin and then heated and rinsed in water. The slide is then decolorized with acid-alcohol (HCl in ethanol for example), rinsed, counterstained (with malachite green for example), rinsed and dried.</p>','2015-10-16 19:19:58',3),(2839,1660,'PS','en','<p>noun</p>','2015-10-16 19:49:41',3),(2840,1660,'DE','en','<p>A diazo dye used as a pH indicator which is blue below pH 3.0 and red above pH 4.5. Congo red also has a high affinity for beta-linked fibrillar polysaccharides and can therefore be used as a stain.</p>','2015-10-16 19:51:11',3),(2841,1660,'PR','en','<p>/ˈkɒŋ goʊ rɛd/</p>','2015-10-16 20:07:24',3),(2842,1661,'PR','en','<p>/suˈd&aelig;n bl&aelig;k/</p>','2015-10-16 20:17:42',3),(2843,1661,'PS','en','<p>noun</p>','2015-10-16 20:17:57',3),(2844,1661,'DE','en','<p>A diazo dye used for stainging intracellular lipids.</p>','2015-10-16 20:22:18',3),(2845,60,'NA','en','<p>See twitching.</p>','2015-10-19 13:28:06',3),(2846,60,'PS','en','<p>Verb</p>','2015-10-19 13:28:19',3),(2847,1662,'DE','en','<p>Motility produced by the rotation of one or more flagella. See random-walk</p>','2015-10-19 13:45:12',3),(2848,1663,'ET','en','<p>Old French, from desvuidier</p>','2015-10-19 13:51:11',3),(2849,1663,'PR','en','<p>/dɪˈvɔɪd/</p>','2015-10-19 13:51:33',3),(2850,1663,'PS','en','<p>adjective</p>','2015-10-19 13:52:20',3),(2851,1663,'DE','en','<p>not possessing or destitute of.</p>','2015-10-19 13:54:36',3),(2852,1664,'ET','en','<p>Late Latin, from multiplus</p>','2015-10-19 13:55:12',3),(2853,1664,'PR','en','<p>/ˈmʌltəpəl/</p>','2015-10-19 13:55:27',3),(2854,1664,'PS','en','<p>adjective</p>','2015-10-19 13:55:40',3),(2855,1664,'DE','en','<p>indicating several or many, more than one.</p>','2015-10-19 13:55:58',3),(2856,1666,'NA','en','<p>See psychrophile</p>','2015-10-19 14:15:52',3),(2857,1667,'ET','en','<p>Greek,&nbsp; from hyp&eacute;r + therm&oacute;s &amp; Latin, from philus</p>','2015-10-19 14:23:22',3),(2858,1667,'PR','en','<p>/ˈhaɪpərˈ&theta;ɜrməˌfaɪl/</p>','2015-10-19 14:23:41',3),(2859,1667,'PS','en','<p>noun</p>','2015-10-19 14:23:56',3),(2860,1667,'DE','en','<p>An extremely heat loving organism. An organism whose optimal growth temperature is between 80 to 110 degrees Celsius. Organisms in this group normally can not grow below sixty degrees Celsius.</p>','2015-10-19 14:24:10',3),(2861,1668,'NA','en','<p>See hyperthermophile</p>','2015-10-19 14:25:45',3),(2862,1669,'NA','en','<p>See hyperthermophile.</p>','2015-10-19 14:25:59',3),(2863,1670,'PR','en','<p>(ˌstɛnəˈ&theta;ɜːməl)</p>','2015-10-19 14:26:34',3),(2864,1670,'PS','en','<p>adjective</p>','2015-10-19 14:26:46',3),(2865,1670,'DE','en','<p>Used to describe an organism which grows in or tolerates only a narrow temperature range. Compare to \"eurythermal\".</p>','2015-10-19 14:28:47',3),(2866,1671,'PR','en','<p>/ˌyʊərəˈ&theta;ɜrməl/</p>','2015-10-19 14:29:20',3),(2867,1671,'PS','en','<p>adjective</p>','2015-10-19 14:29:33',3),(2868,1671,'DE','en','<p>Used to describe an organism which grows in or tolerates a wide range of&nbsp; temperatures. Compare to \"stenothermal\".</p>','2015-10-19 14:30:06',3),(2869,1672,'ET','en','<p>Greek, from an, āer &amp; b&iacute;os. Latin, from respīrātiōn</p>','2015-10-19 14:52:20',3),(2870,1672,'PR','en','<p>/ˌ&aelig;nəˈroʊbɪk ˌrɛspəˈreɪʃən/</p>','2015-10-19 14:52:33',3),(2871,1672,'PS','en','<p>noun</p>','2015-10-19 14:52:44',3),(2872,1672,'DE','en','<p>Respiration that occurs in anaerobic conditions. That is to say, respiration where the terminal electron acceptor is not oxygen.</p>','2015-10-19 14:53:10',3),(2873,1674,'NA','en','<p>See <a title=\"see details from alkalophile\" href=\"index.php?tema=469\">alkalophile</a>.</p>','2015-10-19 15:28:09',3),(2874,1676,'DE','en','<p>A zone of lysis or cell inhibition caused by virus infection on a lawn of bacterial cells.</p>','2015-10-19 16:37:30',3),(2875,1676,'PS','en','<p>noun</p>','2015-10-19 16:37:45',3),(2876,1676,'PR','en','<p>/pl&aelig;k/</p>','2015-10-19 16:38:04',3),(2877,1676,'ET','en','<p>Middle Dutch, from placken</p>','2015-10-19 16:38:16',3),(2878,1676,'DE','en','<p><a title=\"see details from  dental plaque (Related Term) \" href=\"index.php?tema=1677&amp;/dental-plaque\">dental plaque</a></p>','2015-10-19 16:40:19',3),(2879,1677,'ET','en','<p>Medieval Latin, from dentālis &amp; Middle Dutch, from placken</p>','2015-10-19 16:40:35',3),(2880,1677,'PR','en','<p>/ˈdɛn tl pl&aelig;k/</p>','2015-10-19 16:40:45',3),(2881,1677,'PS','en','<p>noun</p>','2015-10-19 16:41:03',3),(2882,1677,'DE','en','<p>A thin biofilm which forms on the surfaces of teeth consisting of a mixed microbial flora embedded in a matrix composed largely of extracellular polysaccharides.</p>','2015-10-19 16:41:25',3),(2883,1678,'PS','en','<p>noun</p>','2015-10-19 18:22:24',3),(2884,1678,'DE','en','<p>A small glass test tube open at one end that is used to detect gas production by microbes in liquid culture. A Durham tube is placed inverted within a test tube that is filled with liquid media, and the apparatus is then autoclaved (this drives all air from the Durham tube). After the media is inoculated and incubated any gas formed by the cultured microbes will be trapped within the Durham tube.</p>','2015-10-19 18:24:04',3),(2885,1679,'ET','en','<p>Greek, from &eacute;ndon &amp; symbio&ucirc;n</p>','2015-10-19 18:57:36',3),(2886,1679,'PR','en','<p>[en-doh-sim-bee-ont]</p>','2015-10-19 18:58:03',3),(2887,1679,'PS','en','<p>noun</p>','2015-10-19 18:58:20',3),(2888,1679,'DE','en','<p>Any organism which lives within the tissue or cells of another organism in a symbiotic association. Many cases are obligate endosymbionts; that is to say, the endosymbiont, the host, or both can not survive without the other.</p>','2015-10-19 18:58:42',3),(2889,1680,'ET','en','<p>Greek, from &eacute;ndon &amp; phuton</p>','2015-10-19 19:11:25',3),(2890,1680,'PR','en','<p>/ˈɛn dəˌfaɪt/</p>','2015-10-19 19:11:38',3),(2891,1680,'PS','en','<p>noun</p>','2015-10-19 19:11:49',3),(2892,1680,'DE','en','<p>A parasite or endosymbiont which lives within a plant for part or all of its life.</p>','2015-10-19 19:12:22',3),(2893,1681,'ET','en','<p>Greek, from enterik&oacute;s &amp; baktḗria</p>','2015-10-19 19:58:24',3),(2894,1681,'PR','en','<p>/ɛnˈtɛr ɪk b&aelig;kˈtɪər i ə/</p>','2015-10-19 19:58:47',3),(2895,1681,'PS','en','<p>noun</p>','2015-10-19 19:59:03',3),(2896,1681,'DE','en','<p>Any or all bacteria normally found in the intestinal tract.</p>','2015-10-19 20:00:33',3),(2897,1681,'DE','en','<p>Members of the family <em>enterobacteriaceae.</em></p>','2015-10-19 20:04:06',3),(2898,1506,'PS','en','<p>noun</p>','2015-10-19 20:50:04',3),(2899,1506,'PR','en','<p>/ɪnˈklu ʒən ˈbɒd i/</p>','2015-10-19 20:50:15',3),(2900,1506,'ET','en','<p>Latin, from inclūsiōn &amp; Old English, from bodig</p>','2015-10-19 20:50:28',3),(2901,1506,'DE','en','<p>discrete structures of various types present within the cytoplasmic matrix of cells.</p>','2015-10-19 20:51:13',3),(2902,1682,'NA','en','<p>See <a title=\"see details from disc diffusion\" href=\"index.php?tema=976\">disc diffusion</a>.</p>','2015-10-20 14:41:03',3),(2903,1682,'PS','en','<p>noun</p>','2015-10-20 14:41:42',3),(2904,1683,'ET','en','<p>Greek, from mīkro + b&iacute;os &amp; Late Latin, from matta</p>','2015-10-20 15:10:12',3),(2905,1683,'PR','en','<p>/ˈmaɪ kroʊb m&aelig;t/</p>','2015-10-20 15:08:50',3),(2906,1683,'PS','en','<p>noun</p>','2015-10-20 15:08:59',3),(2907,1683,'DE','en','<p>A structure of layered microrganisms which develops on surfaceses in aquatic environments.</p>','2015-10-20 15:09:23',3),(2908,1684,'ET','en','<p>Greek, combining ol&iacute;gos + trophik&oacute;s</p>','2015-10-20 16:00:52',3),(2909,1684,'PS','en','<p>noun</p>','2015-10-20 16:00:21',3),(2910,1684,'DE','en','<p>Any organism which can grow in an environment which offers very low levels of nutrient.</p>','2015-10-20 16:00:35',3),(2911,1685,'PS','en','<p>noun</p>','2015-10-20 16:01:59',3),(2912,1685,'DE','en','<p>Any organism which grows only in the presence of high concentration of nutrients.</p>','2015-10-20 16:02:17',3),(2913,1686,'ET','en','<p>Greek, from symb&iacute;ōsis</p>','2015-10-20 17:05:23',3),(2914,1686,'PR','en','<p>/ˌsɪm biˈoʊ sɪs/</p>','2015-10-20 17:05:37',3),(2915,1686,'PS','en','<p>noun</p>','2015-10-20 17:05:47',3),(2916,1686,'DE','en','<p>Two different organisms which live in close physical association.</p>','2015-10-20 17:06:04',3),(2917,1686,'DE','en','<p>Archaic: two different organisms which live in close association to their mutual benefit (see mutualism).</p>','2015-10-20 17:07:36',3),(2918,1687,'DE','en','<p>One of the participants in a symbiotic relationship.</p>','2015-10-20 17:12:55',3),(2919,1687,'PS','en','<p>noun</p>','2015-10-20 17:13:22',3),(2920,1687,'PR','en','<p>/ˈsɪm biˌɒnt,/</p>','2015-10-20 17:13:47',3),(2921,1687,'ET','en','<p>Greek, from symbiont</p>','2015-10-20 17:14:40',3),(2922,1688,'PR','en','<p>/ˈsɪm biˌoʊt,/</p>','2015-10-20 17:17:20',3),(2923,1688,'PS','en','<p>noun</p>','2015-10-20 17:18:05',3),(2924,1688,'NA','en','<p>See <a title=\"see details from symbiont\" href=\"index.php?tema=1687\">symbiont</a></p>','2015-10-20 17:18:40',3),(2925,1689,'ET','en','<p>Middle French, from mutuel &amp; -isme</p>','2015-10-20 18:45:54',3),(2926,1689,'PR','en','<p>/ˈmyu tʃu əˌlɪz əm/</p>','2015-10-20 18:46:07',3),(2927,1689,'PS','en','<p>noun</p>','2015-10-20 18:46:22',3),(2928,1689,'DE','en','<p>Symbiosis in which both symbionts derive benefit from the association. Sometimes used to refer to an association between two organisms which cannot live independently.</p>','2015-10-20 18:46:38',3),(2929,1690,'ET','en','<p>Medieval Latin, from commēnsālis</p>','2015-10-20 19:35:16',3),(2930,1690,'PR','en','<p>/kəˈmɛn səˌlɪz əm/</p>','2015-10-20 19:35:38',3),(2931,1690,'PS','en','<p>noun</p>','2015-10-20 19:35:50',3),(2932,1690,'DE','en','<p>Symbiosis in which one symbiont derives benefit from the association while the other is not affected (no benefit or harm).</p>','2015-10-20 19:36:02',3),(2933,1691,'PS','en','<p>noun</p>','2015-10-21 14:06:34',3),(2934,1691,'DE','en','<p>A chemical entity which accepts electrons transferred to it from another compound. An oxidizing agent which, by accepting electrons, is reduced in the process.</p>','2015-10-21 14:06:50',3),(2935,1692,'PS','en','<p>noun</p>','2015-10-21 14:10:42',3),(2936,1693,'ET','en','<p>Medieval Latin, from a + commēnsālis</p>','2015-10-21 14:43:33',3),(2937,1693,'PR','en','<p>/eɪˈmɛn səˌlɪz əm/</p>','2015-10-21 14:43:48',3),(2938,1693,'PS','en','<p>noun</p>','2015-10-21 14:43:59',3),(2939,1693,'DE','en','<p>Symbiosis in which one symbiont is harmed from the association while the other is not affected (no benefit or harm).</p>','2015-10-21 14:44:11',3),(2940,1694,'NA','en','<p>See amensalism.</p>','2015-10-21 14:45:02',3),(2941,1694,'PS','en','<p>noun</p>','2015-10-21 14:45:26',3),(2942,1694,'ET','en','<p>/eɪˈmɛn səˌlɪz əm/</p>','2015-10-21 14:45:49',3),(2943,1694,'ET','en','<p>Medieval Latin, from a + commēnsālis</p>','2015-10-21 14:46:02',3),(2944,1695,'ET','en','<p>Greek, from antagṓnisma</p>','2015-10-21 14:46:37',3),(2945,1695,'PR','en','<p>/&aelig;nˈt&aelig;g əˌnɪz əm/</p>','2015-10-21 14:46:49',3),(2946,1695,'PS','en','<p>noun</p>','2015-10-21 14:46:59',3),(2947,1695,'DE','en','<p>Symbiosis in which one symbiont derives benefit from the association while the other is harmed.</p>','2015-10-21 14:47:12',3),(2948,1695,'DE','en','<p>Inhibition of one entity by another similar entity.</p>','2015-10-21 14:50:17',3),(2949,1696,'ET','en','<p>milk + y, from Old English meolc + -ig</p>','2015-10-21 15:30:38',3),(2950,1696,'PR','en','<p>/ˈmɪl ki/</p>','2015-10-21 15:30:52',3),(2951,1696,'PS','en','<p>adjective</p>','2015-10-21 15:31:10',3),(2952,1696,'DE','en','<p>Like milk in appearance or consistency.</p>','2015-10-21 15:31:26',3),(2953,1697,'ET','en','<p>slime + y, from Old Norse slīm</p>','2015-10-21 15:48:25',3),(2954,1697,'PR','en','<p>/ˈslaɪ mi/</p>','2015-10-21 15:48:46',3),(2955,1697,'PS','en','<p>adjective</p>','2015-10-21 15:49:02',3),(2956,1697,'DE','en','<p>Like a ropy, viscous liquid in appearance or consistency.</p>','2015-10-21 15:49:18',3),(2957,1698,'DE','en','<p>A gene which encodes the RecA protein.</p>','2015-10-21 16:20:51',3),(2958,1698,'NA','en','<p>Not to be confused with RecA (non italic and capital \"R\") which denotes the protein.</p>','2015-10-21 16:20:21',3),(2959,1699,'DE','en','<p>A protein which plays an essential role in the repair and maintenance of DNA.</p>','2015-10-21 16:22:09',3),(2960,1699,'NA','en','<p>Not to be confused with recA (italic and lowercase \"r\") which denotes the gene.</p>','2015-10-21 16:23:16',3),(2961,1700,'PS','en','<p>adjective</p>','2015-11-09 16:28:18',3),(2962,1700,'ET','en','<p>Greek, combining form of e&uacute;s and g&oacute;nos</p>','2015-11-09 16:28:57',3),(2963,1700,'PR','en','<p>/yuˈgɒn ɪk/</p>','2015-11-09 16:29:13',3),(2964,1700,'DE','en','<p>refers to a strain which produces more luxuriant growth on artificial media than that produced by other strains.</p>','2015-11-09 16:29:30',3),(2965,1701,'ET','en','<p>Greek, combining form of dys and g&oacute;nos</p>','2015-11-09 16:30:33',3),(2966,1701,'PR','en','<p>/dɪsˈgɒn ɪk/</p>','2015-11-09 16:30:43',3),(2967,1701,'PS','en','<p>adjective</p>','2015-11-09 16:31:20',3),(2968,1701,'DE','en','<p>refers to a strain which produces poor growth on artificial media when compared to that produced by other strains.</p>','2015-11-09 16:31:37',3);
